11384=>["Value"=>11384,"TextKey"=>"图鉴描述10501","TextValue"=>"The King of the Hill Kingdom. A total sweet tooth. He's loved by the people for being happy-go-lucky, amiable and charismatic."],
11385=>["Value"=>11385,"TextKey"=>"图鉴描述10502","TextValue"=>"Universalmente conhecido como um dos maiores magos da era. Dotado com uma mente fértil, benevolência, amabilidade e discernimento. De todos os disfarces, ele geralmente se transforma em um coelho e somente alguns viram seu verdadeiro rosto por detrás da magia."],
11386=>["Value"=>11386,"TextKey"=>"图鉴描述10503","TextValue"=>"O lendário compositor e contador de histórias da tribo. Conforme viaja pelos mares e pelas terras, ninguém jamais o viu por perto. Com sua voz profunda e inteligência, foram cantadas muitas homenagens. "],
11387=>["Value"=>11387,"TextKey"=>"图鉴描述10504","TextValue"=>"Puro e peng. Cheia de curiosidade sobre o mundo, ela gosta de tocar tambor sempre que se sente expressiva."],
11388=>["Value"=>11388,"TextKey"=>"图鉴描述10505","TextValue"=>"O Rei de todos os leões e anda como um humano. Perdeu sua maravilhosa terra natal uma vez, junto com os membros de sua tribo, mas com sua força excepcional, inteligência e bravura, um verdadeiro líder que a recuperará no final."],
11389=>["Value"=>11389,"TextKey"=>"图鉴描述10506","TextValue"=>"Walked out of a heartbreaking past, she becomes stronger and more optimistic. She also learnt a magic that can makes visions in match flames come true."],
11390=>["Value"=>11390,"TextKey"=>"图鉴描述10507","TextValue"=>"He's wee stingy and naughty. Was once cursed by the Witch because of his prank. With a pumpkin head, he becomes more kind, often holding a lantern to light passers-by in the dark."],
