12668=>["Value"=>12668,"TextKey"=>"新手引导题头文本2512","TextValue"=>"Paraíso dos brinquedos"],
12669=>["Value"=>12669,"TextKey"=>"新手引导题头文本2520","TextValue"=>"<size=90%>Pontos do Evento<br>Objetos"],
12670=>["Value"=>12670,"TextKey"=>"新手引导题头文本2522","TextValue"=>"<size=90%>Pontos do Evento<br>Objetos"],
12671=>["Value"=>12671,"TextKey"=>"新手引导题头文本2523","TextValue"=>"<size=90%>Pontos do Evento<br>Objetos"],
12672=>["Value"=>12672,"TextKey"=>"新手引导题头文本2530","TextValue"=>"Praia de Férias"],
12673=>["Value"=>12673,"TextKey"=>"新手引导题头文本2531","TextValue"=>"Praia de Férias"],
12674=>["Value"=>12674,"TextKey"=>"新手引导题头文本2532","TextValue"=>"Praia de Férias"],
12675=>["Value"=>12675,"TextKey"=>"新手引导题头文本2534","TextValue"=>"Trabalhador Rápido"],
12676=>["Value"=>12676,"TextKey"=>"新手引导题头文本2540","TextValue"=>"Casa dos Heróis"],
12677=>["Value"=>12677,"TextKey"=>"新手引导题头文本2541","TextValue"=>"Casa dos Heróis"],
12678=>["Value"=>12678,"TextKey"=>"新手引导题头文本2542","TextValue"=>"Princesa da Tribo"],
12679=>["Value"=>12679,"TextKey"=>"新手引导题头文本2543","TextValue"=>"Coletar Ingredientes"],
12680=>["Value"=>12680,"TextKey"=>"新手引导题头文本2544","TextValue"=>"Livro de Magia"],
12681=>["Value"=>12681,"TextKey"=>"新手引导说明1012","TextValue"=>"<line-height=130%><color=#38aec0>A Terra-mãe</color> está desbloqueada! Vá lá espreitar!"],
12682=>["Value"=>12682,"TextKey"=>"新手引导说明2000","TextValue"=>"<line-height=130%> Ó pessoa bondosa aí, ajude-me por favor!"],
12683=>["Value"=>12683,"TextKey"=>"新手引导说明2001","TextValue"=>"<line-height=130%>Estou preso nestes <color=#38c0a5>Totens</color>!"],
12684=>["Value"=>12684,"TextKey"=>"新手引导说明2002","TextValue"=>"Arraste 3 <color=#38c0a5>Totens</color> do mesmo tipo juntos para despertar a <color=#f58c26>Fusão</color>, e a maldição será desfeita."],
12685=>["Value"=>12685,"TextKey"=>"新手引导说明2010","TextValue"=>"<line-height=130%> Ah! Não vejo nenhuns totens aqui!"],
12686=>["Value"=>12686,"TextKey"=>"新手引导说明2011","TextValue"=>"<line-height=130%>Veja! É o<color=#f58c26> Código da Criação </color>. Irá vê-lo em vários níveis. Vamos ver o que está escrito lá dentro."],
12687=>["Value"=>12687,"TextKey"=>"新手引导说明2012","TextValue"=>"<line-height=130%> Toque para obter dicas úteis do jogo. Experimente!"],
12688=>["Value"=>12688,"TextKey"=>"新手引导说明2020","TextValue"=>"<line-height=130%>Se quer superar um nível, precisa de obter um <color=#f58c26>Objeto Designado</color>."],
12689=>["Value"=>12689,"TextKey"=>"新手引导说明2022","TextValue"=>" <line-height=130%>Os <color=#f58c26>Objetivos do Nível</color> dir-lhe-ão o que precisa de obter. Comece a fundir e ganhe!"],
12690=>["Value"=>12690,"TextKey"=>"新手引导说明2030","TextValue"=>"<line-height=120%>Uau, uma <color=#ef933d>Escultura da Embla Jovem</color>! Os poderes deles também desapareceram! Temos de acordar a<color=#f58c26>Embla</color> fundindo as esculturas."],
12691=>["Value"=>12691,"TextKey"=>"新手引导说明2031","TextValue"=>"Se um nível tiver estas esculturas, pode normalmente superar o nível através da fusão das mesmas."],
12692=>["Value"=>12692,"TextKey"=>"新手引导说明2032","TextValue"=>"<line-height=130%>Estas terras perderam a sua ligação com a Deusa, por isso caíram num sono profundo."],
12693=>["Value"=>12693,"TextKey"=>"新手引导说明2033","TextValue"=>"<line-height=130%> Não pode mover objetos nas <color=#38aec0>Terras Dormentes</color>."],
12694=>["Value"=>12694,"TextKey"=>"新手引导说明2034","TextValue"=>"<line-height=130%>Funda quaisquer <color=#38c0a5>Flores Espirituais</color> para acordar a terra."],
12695=>["Value"=>12695,"TextKey"=>"新手引导说明2035","TextValue"=>"<line-height=130%>Quando ganhar,<color=#f58c26>a Deusa Embla</color> vai acordar todas as terras!"],
12696=>["Value"=>12696,"TextKey"=>"新手引导说明2040","TextValue"=>"<line-height=130%>Veja! É um <color=#38c0a5>Totem</color>."],
12697=>["Value"=>12697,"TextKey"=>"新手引导说明2041","TextValue"=>"Apresse-se a fundir <color=#38c0a5>Três Totens</color> para salvar o membro tribal preso no interior!"],
12698=>["Value"=>12698,"TextKey"=>"新手引导说明2050","TextValue"=>"Como dissemos, pode tocar numa <color=#38c0a5>Esfera de Runas Selvagem</color>para acordar a terra."],
12699=>["Value"=>12699,"TextKey"=>"新手引导说明2051","TextValue"=>"<line-height=130%> Claro, também pode fundi-los para obter avançados!"],
12700=>["Value"=>12700,"TextKey"=>"新手引导说明2060","TextValue"=>"Pode fundir objectos na<color=#38aec0>Terra Dormente</color> com objectos em terras normais para acordar automaticamente os inactivos."],
12701=>["Value"=>12701,"TextKey"=>"新手引导说明2070","TextValue"=>"Toque num <color=#38c0a5>Grupo de Totens</color> para obter um<color=#38c0a5>Totem</color>."],
12702=>["Value"=>12702,"TextKey"=>"新手引导说明2080","TextValue"=>"Algumas <color=#38aec0>Terras Super Dormentes</color> não podem ser acordadas através de <color=#f58c26>Pontos de Vura</color>, mas só podem ser acordadas fundindo os seus objetos com os das terras normais."],
12703=>["Value"=>12703,"TextKey"=>"新手引导说明2090","TextValue"=>"<line-height=130%>De agora em diante, os níveis vêm com <color=#f58c26>Tarefas</color>."],
12704=>["Value"=>12704,"TextKey"=>"新手引导说明2091","TextValue"=>"<line-height=130%>Pode verificar a <color=#38c0a5>Tarefa Sol</color> para as tarefas e recompensas."],
12705=>["Value"=>12705,"TextKey"=>"新手引导说明2093","TextValue"=>"<line-height=130%>Este botão pode bloquear e desbloquear a<color=#f58c26>Função de Arrastar ecrã</color>."],
12706=>["Value"=>12706,"TextKey"=>"新手引导说明2100","TextValue"=>"Alguns objetos não podem ser fundidos diretamente. Toque na <color=#ef933d>Pilha de Rochas em Forma de Cunha</color> para as dividir em <color=#ef933d>Rocha em Forma de Cunha</color> e depois fundir. "],
12707=>["Value"=>12707,"TextKey"=>"新手引导说明2110","TextValue"=>"<line-height=130%>Tem de verificar <color=#f58c26>Objetivos do Nível</color>."],
12708=>["Value"=>12708,"TextKey"=>"新手引导说明2130","TextValue"=>"<line-height=130%>Podemos obter<color=#ef933d>Rebentos de Arbusto</color> de <color=#38c0a5>Ossos de Dragão</color>."],
12709=>["Value"=>12709,"TextKey"=>"新手引导说明2140","TextValue"=>"Esta é uma enorme<color=#ef933d>Bomba de Despertar</color>. Se acordar a terra ao lado, ela acordará automaticamente, e despertará os azulejos que a rodeiam diretamente."],
12710=>["Value"=>12710,"TextKey"=>"新手引导说明2150","TextValue"=>"Membros tribais podem recolher <color=#38c0a5>Minério Selvagem</color> para si do nível mais elevado de <color=#38c0a5>Vinhas</color>."],
12711=>["Value"=>12711,"TextKey"=>"新手引导说明2160","TextValue"=>"Este é um <color=#ef933d>Túmulo Estilhaçado</color>. Se os negligenciar ou fundir, eles transformar-se-ão em aterradores ´<color=#df66a8>Zombies</color>. Derrote-os para obter <color=#38c0a5>Pirilampos</color>, que são necessários para passar o nível."],
12712=>["Value"=>12712,"TextKey"=>"新手引导说明2170","TextValue"=>"Um <color=#ef933d>Ninho Abandonado</color> gera constantemente zombies mesmo quando estão adormecidos. Tocar lá gera imediatamente um zombie! Destruir os zombies dá-lhe <color=#38c0a5>Minério Selvagem</color>."],
12713=>["Value"=>12713,"TextKey"=>"新手引导说明2180","TextValue"=>"Isto é um <color=#38c0a5>Portal de Runas do Druida</color>, que sorte que temos! Funda-os para convocar um <color=#38c0a5>Membro Tribal</color> da Terra-mãe para o ajudar."],
12714=>["Value"=>12714,"TextKey"=>"新手引导说明2190","TextValue"=>"A remanência da Árvore Santa da Criação. Produz automaticamente <color=#38c0a5>Esferas de Runa Selvagem</color>. Quanto mais alto for o nível, mais forte é o poder de cura."],
12715=>["Value"=>12715,"TextKey"=>"新手引导说明2200","TextValue"=>" <color=#ef933d>Nuvens</color> vão continuar a aparecer por aqui. Clique-lhes para fazer chover. <color=#38c0a5>Poças</color> e <color=#38c0a5>Flores Espirituais</color> vão aparecer em terras vazias por baixo delas."],
12716=>["Value"=>12716,"TextKey"=>"新手引导说明2210","TextValue"=>"<line-height=130%>Estranho... onde estão as<color=#ef933d> Esculturas da Embla Jovem</color>?"],
12717=>["Value"=>12717,"TextKey"=>"新手引导说明2211","TextValue"=>"<line-height=130%>Oh, sim, se completar as <color=#f58c26>Tarefas</color>, eles vão aparecer!"],
12718=>["Value"=>12718,"TextKey"=>"新手引导说明2220","TextValue"=>"Esta é uma <color=#ef933d>Estátua do Demónio</color>. Um trabalho hediondo! Peça ao seu povo que o anuncie para obter um<color=#ef933d>Escultura da Embla Jovem</color>."],
12719=>["Value"=>12719,"TextKey"=>"新手引导说明2230","TextValue"=>"<line-height=130%> Um novo Campo abriu! Vá ver ao Mapa Mundo!"],
12720=>["Value"=>12720,"TextKey"=>"新手引导说明2240","TextValue"=>"<line-height=130%> Estou livre de novo! Muito obrigado! "],
12721=>["Value"=>12721,"TextKey"=>"新手引导说明2241","TextValue"=>"<line-height=130%>As pessoas da nossa tribo estão presas nestes<color=#38c0a5>Totens</color>!"],
12722=>["Value"=>12722,"TextKey"=>"新手引导说明2242","TextValue"=>"<line-height=130%>A tribo precisa da sua ajuda para encontrar outros membros tribais aqui, bem como em casa."],
12723=>["Value"=>12723,"TextKey"=>"新手引导说明2243","TextValue"=>"<line-height=130%>Vá procurá-los no próximo nível!"],
12724=>["Value"=>12724,"TextKey"=>"新手引导说明2250","TextValue"=>"Pode <color=#f58c26> tocar duas vezes</color> em alguns objetos para chamar alguém a vir colher deles."],
12725=>["Value"=>12725,"TextKey"=>"新手引导说明2251","TextValue"=>"<line-height=130%>Pode usar ou fundir os objetos que reuniu."],
12726=>["Value"=>12726,"TextKey"=>"新手引导说明2252","TextValue"=>"<line-height=130%>Colha de uma <color=#38c0a5>Flor Espiritual</color> para obter uma<color=#38c0a5>Esfera de Runas Selvagem</color>."],
12727=>["Value"=>12727,"TextKey"=>"新手引导说明2253","TextValue"=>"<color=#f58c26>Clique na esfera</color> para acordar as<color=#38aec0>Terras Dormentes</color>."],
12728=>["Value"=>12728,"TextKey"=>"新手引导说明2261","TextValue"=>"<line-height=130%> De agora em diante, pode selecionar prémios no final de cada nível."],
12729=>["Value"=>12729,"TextKey"=>"新手引导说明2262","TextValue"=>"<line-height=130%>Os prémios são normalmente <color=#38c0a5>Ouro</color> ou outros recursos úteis. Por vezes até um totem."],
12730=>["Value"=>12730,"TextKey"=>"新手引导说明2263","TextValue"=>"<line-height=130%>As suas recompensas serão colocadas em<color=#f58c26> Bolhas </color>e enviadas para casa."],
12731=>["Value"=>12731,"TextKey"=>"新手引导说明3000","TextValue"=>"<line-height=130%>Esta é a sua<color=#f58c26>Terra-mãe</color>."],
12732=>["Value"=>12732,"TextKey"=>"新手引导说明3001","TextValue"=>"<line-height=130%>Onde costumava ser a nossa casa, antes da <color=#f58c26>Grande Inundação</color> destruir a nossa vida pacífica, deixando um forte nevoeiro a cobrir a terra."],
12733=>["Value"=>12733,"TextKey"=>"新手引导说明3002","TextValue"=>"<line-height=105%>Funda objetos com objetos de terras adormecidas para acordar a terra diretamente! Tente fundir para resgatar mais membros tribais! Quanto maior for a sua população, mais nevoeiro pode limpar, e mais rápido pode reconstruir a nossa casa."],
12734=>["Value"=>12734,"TextKey"=>"新手引导说明3005","TextValue"=>"<line-height=130%>Só pode desbloquear um <color=#38c0a5>Cofre do Tesouro do Tempo</color> de uma só vez. Aguarde o fim da contagem decrescente para os obter, ou gaste Rubies para obter qualquer <color=#38c0a5>Cofre do Tesouro do Tempo</color> imediatamente."],
12735=>["Value"=>12735,"TextKey"=>"新手引导说明3006","TextValue"=>"<line-height=130%>As recompensas de nível chegaram! Abra as bolhas e vá lá ver!"],
12736=>["Value"=>12736,"TextKey"=>"新手引导说明3010","TextValue"=>"<line-height=130%><color=#38c0a5>Cabanas Comunitárias</color> são sítios onde os trabalhadores podem descansar. Eles sairão depois de um certo tempo."],
12737=>["Value"=>12737,"TextKey"=>"新手引导说明3011","TextValue"=>"<line-height=130%><color=#38c0a5>Cabanas Comunitárias</color>podem ser fundidas em níveis mais elevados. Quanto mais elevado for o nível, menos tempo gastarão os membros tribais a descansar."],
12738=>["Value"=>12738,"TextKey"=>"新手引导说明3016","TextValue"=>"<line-height=130%>Gaste<color=#38c0a5>Rubies</color> para acordá-los imediatamente."],
12739=>["Value"=>12739,"TextKey"=>"新手引导说明3030","TextValue"=>"Pode completar mais tarefas na Terra-mãe para obter mais <color=#38c0a5>Heranças Esquecidas</color>. Toque nelas para obter recompensas especiais!"],
12740=>["Value"=>12740,"TextKey"=>"新手引导说明3040","TextValue"=>"<line-height=130%>Este é um pequeno pedaço de<color=#38c0a5>Ouro</color>."],
12741=>["Value"=>12741,"TextKey"=>"新手引导说明3041","TextValue"=>"<line-height=120%>Pode tocar-lhes para obter algum <color=#38c0a5>Ouro </color>, ou pode fundi-los em pepitas de ouro mais avançadas."],
12742=>["Value"=>12742,"TextKey"=>"新手引导说明3042","TextValue"=>"<line-height=130%>Pode gastar o seu <color=#38c0a5>Ouro</color> na<color=#f58c26>Loja</color>."],
12743=>["Value"=>12743,"TextKey"=>"新手引导说明3050","TextValue"=>"<line-height=130%>Demasiado ouro? Pode ir comprar coisas muito boas na loja!"],
12744=>["Value"=>12744,"TextKey"=>"新手引导说明3060","TextValue"=>"<line-height=130%>Todos os <color=#df66a8>Membros Tribais</color> estão demasiado cansados. Precisam todos de um intervalo para restaurar a energia."],
12745=>["Value"=>12745,"TextKey"=>"新手引导说明3061","TextValue"=>"<line-height=130%>Tempo para superar mais níveis e salvar mais pessoas!"],
12746=>["Value"=>12746,"TextKey"=>"新手引导说明3062","TextValue"=>"<line-height=120%>Quantos mais membros tribais tiver, mais recursos poderão reunir para si antes de adormecerem."],
12747=>["Value"=>12747,"TextKey"=>"新手引导说明3063","TextValue"=>"<line-height=130%>Supere níveis para resgatar mais membros tribais."],
12748=>["Value"=>12748,"TextKey"=>"新手引导说明3064","TextValue"=>"<line-height=130%> E traga-os de volta a casa!"],
12749=>["Value"=>12749,"TextKey"=>"新手引导说明3065","TextValue"=>"<line-height=130%>Veja! Pode ir para o Campo ao tocar no<color=#f58c26>Mapa Mundo</color>."],
12750=>["Value"=>12750,"TextKey"=>"新手引导说明3070","TextValue"=>"<line-height=130%>Já não há espaço para colocar nada: o chão está completamente coberto!"],
12751=>["Value"=>12751,"TextKey"=>"新手引导说明3071","TextValue"=>"<line-height=130%>Selecione um objeto, e selecione na caixa de informação para o vender ou deitar fora. "],
12752=>["Value"=>12752,"TextKey"=>"新手引导说明3080","TextValue"=>"Esta é uma <color=#38c0a5>Herança Alienígena</color>, é extremamente rara! Toque nela para receber <color=#38c0a5>Rubies</color>! Ou pode fundi-los em outros mais avançados!"],
12753=>["Value"=>12753,"TextKey"=>"新手引导说明3090","TextValue"=>"<line-height=130%>Este é um pequeno pedaço de<color=#38c0a5>Minério Selvagem</color>."],
12754=>["Value"=>12754,"TextKey"=>"新手引导说明3091","TextValue"=>"<line-height=130%>Pode tocar-lhes para obter algum <color=#38c0a5>Minério Selvagem </color>, ou pode fundi-los para obter mais avançados!"],
12755=>["Value"=>12755,"TextKey"=>"新手引导说明3092","TextValue"=>"<line-height=130%>Pode gastar os <color=#38c0a5>Minérios Selvagens</color> que recolheu na<color=#f58c26>Loja</color>."],
12756=>["Value"=>12756,"TextKey"=>"新手引导说明3100","TextValue"=>"<line-height=130%> Se o seu <color=#38c0a5> armazenamento de</color> Minério Selvagem estiver a ficar cheio, pode gastá-lo na loja."],
12757=>["Value"=>12757,"TextKey"=>"新手引导说明3110","TextValue"=>"Esta <color=#38c0a5>Barricada</color> aqui incomoda-me muito! Mas não se pode movê-la diretamente. Pode mandar os seus <color=#df66a8>Membros Tribais</color> atacá-las e separá-las em barricadas mais pequenas."],
12758=>["Value"=>12758,"TextKey"=>"新手引导说明3120","TextValue"=>"<color=#38c0a5>Os Barbetes </color>contaminam terras mesmo quando estão em terra dormente. A <color=#f58c26>Barra de Progresso</color> mostra quanto tempo decorre entre cada disparo. Só se pode atacar uma barbela acordada."],
12759=>["Value"=>12759,"TextKey"=>"新手引导说明3130","TextValue"=>"Este é um <color=#f58c26>Altar do Herói</color>. Os heróis irão alternar entre<color=#f58c26>Modo Inativo</color>e <color=#f58c26>Modo Patrulha</color>."],
12760=>["Value"=>12760,"TextKey"=>"新手引导说明3131","TextValue"=>"Com um herói por perto, haverá surpresas adicionais para quaisquer <color=#f58c26>fusões de 4 objetos</color>!"],
12761=>["Value"=>12761,"TextKey"=>"新手引导说明3132","TextValue"=>"Se estiverem inativos, pode gastar<color=#38c0a5>Rubis</color> para acordá-los imediatamente."],
12762=>["Value"=>12762,"TextKey"=>"新手引导说明3133","TextValue"=>"Pode tocar aqui para verificar algumas informações do Herói"],
12763=>["Value"=>12763,"TextKey"=>"新手引导说明3142","TextValue"=>"<line-height=130%>Os heróis têm capacidades únicas como unidades fortes da tribo."],
12764=>["Value"=>12764,"TextKey"=>"新手引导说明3144","TextValue"=>"<line-height=130%>Pode verificar as descrições das capacidades de um herói aqui na <color=#f58c26>Caixa de habilidades do Herói</color>."],
12765=>["Value"=>12765,"TextKey"=>"新手引导说明3145","TextValue"=>"<line-height=130%>Pode evoluir os heróis submetendo <color=#f58c26>Missões</color> terminadas."],
12766=>["Value"=>12766,"TextKey"=>"新手引导说明3147","TextValue"=>"Acabe todas as missões para o seu herói subir de nível!"],
12767=>["Value"=>12767,"TextKey"=>"新手引导说明3150","TextValue"=>"<line-height=130%> Bom trabalho! Mais membros tribais libertaram-se do selo do feiticeiro!"],
12768=>["Value"=>12768,"TextKey"=>"新手引导说明3151","TextValue"=>"Com mais membros na sua tribo, pode limpar mais <color=#f58c26>Nevoeiro</color>!"],
12769=>["Value"=>12769,"TextKey"=>"新手引导说明3152","TextValue"=>"<line-height=130%>O nevoeiro em cada área requer um certo nível de Poder Tribal para se dissipar."],
12770=>["Value"=>12770,"TextKey"=>"新手引导说明3153","TextValue"=>"<line-height=130%>Agora pode limpar o nevoeiro desta área!"],
12771=>["Value"=>12771,"TextKey"=>"新手引导说明3161","TextValue"=>"Ainda não pode limpar este nevoeiro."],
12772=>["Value"=>12772,"TextKey"=>"新手引导说明3162","TextValue"=>"<line-height=130%>Os seus <color=#f58c26>Poderes Tribais</color> não são suficientes. Pode comprar mais totens na loja."],
12773=>["Value"=>12773,"TextKey"=>"新手引导说明3165","TextValue"=>"<line-height=130%> Gaste Ouro para comprar Totens!"],
12774=>["Value"=>12774,"TextKey"=>"新手引导说明3166","TextValue"=>"<line-height=130%>O preço dos totens vai aumentar depois de cada compra. Vá arranjar mais ouro!"],
12775=>["Value"=>12775,"TextKey"=>"新手引导说明2270","TextValue"=>"<line-height=130%>Este nível tem um <color=#f58c26>Tempo Limite</color>. Deve completar o teste dentro do tempo indicado, ou perderá."],
12776=>["Value"=>12776,"TextKey"=>"新手引导说明2271","TextValue"=>"<line-height=130%>Pode ver quanto tempo lhe resta."],
12777=>["Value"=>12777,"TextKey"=>"新手引导说明2273","TextValue"=>"<line-height=130%>À medida que o tempo restante for diminuindo, a cor dos números passará de <color=#46bb83>Verde</color> para <color=#eca852>Amarelo</color> e, eventualmente, <color=#e04030>Vermelho</color>."],
12778=>["Value"=>12778,"TextKey"=>"新手引导说明2274","TextValue"=>"<line-height=130%> Para superar o nível mais depressa, pode ir até à Loja."],
12779=>["Value"=>12779,"TextKey"=>"新手引导说明2277","TextValue"=>"<line-height=130%>Pode gastar<color=#38c0a5>Rubis</color> para comprar objetos-chave da loja diretamente."],
12780=>["Value"=>12780,"TextKey"=>"新手引导说明2281","TextValue"=>"<line-height=130%> Este tipo de níveis dão-lhe <color=#38c0a5> Membros Tribais</color> como prémio. Pode gastar <color=#38c0a5> Rubis </color>para duplicar o prémio."],
12781=>["Value"=>12781,"TextKey"=>"新手引导说明2290","TextValue"=>"<line-height=130%>Bem-vindo a outro Julgamento de Deus! Também irá receber uma recompensa depois de passar este desafio."],
12782=>["Value"=>12782,"TextKey"=>"新手引导说明2291","TextValue"=>"<line-height=130%>Pode completar um julgamento<color=#f58c26> três vezes</color>, mas o tempo limite ficará cada vez mais curto."],
12783=>["Value"=>12783,"TextKey"=>"新手引导说明3149","TextValue"=>"<line-height=130%>Terá de esperar pela sessão de treino do herói para subir de nível, ou pode gastar<color=#38c0a5>Rubis</color> para acelerar o processo."],
12784=>["Value"=>12784,"TextKey"=>"新手引导说明2300","TextValue"=>"<line-height=130%>Veja, isto é um<color=#46bb83>Nicho de Encaixe</color>, controla uma grande área de nevoeiro."],
12785=>["Value"=>12785,"TextKey"=>"新手引导说明2301","TextValue"=>"<line-height=130%> Arraste os objetos correspondentes até ao nicho para limpar o nevoeiro."],
12786=>["Value"=>12786,"TextKey"=>"新手引导说明2302","TextValue"=>"<line-height=130%>Se o nicho continuar dormente, terá de acordá-lo primeiro."],
12787=>["Value"=>12787,"TextKey"=>"新手引导说明2400","TextValue"=>"<line-height=130%>Bem-vindo a um evento! Só estará aberto por um tempo limitado!"],
12788=>["Value"=>12788,"TextKey"=>"新手引导说明2401","TextValue"=>"<line-height=130%>Participar num evento dá-lhe montes de prémios, que serão enviados para a sua Terra-mãe!"],
12789=>["Value"=>12789,"TextKey"=>"新手引导说明2402","TextValue"=>"<line-height=130%>Aqui verá alguns objetos únicos, novas criaturas e novas formas de jogar!"],
12790=>["Value"=>12790,"TextKey"=>"新手引导说明3180","TextValue"=>"<line-height=130%>As tochas são necessárias para se aventurar em níveis! Elas recarregam ao longo do tempo."],
12791=>["Value"=>12791,"TextKey"=>"新手引导说明3181","TextValue"=>"<line-height=130%>Tem montes de tochas agora! Vá usá-las para jogar em níveis!"],
12792=>["Value"=>12792,"TextKey"=>"新手引导说明1072","TextValue"=>"<line-height=130%> De agora em diante, pode verificar as suas <color=#38c0a5>Recompensas do Campo</color>!"],
12793=>["Value"=>12793,"TextKey"=>"新手引导说明1073","TextValue"=>"<line-height=130%>Quando for altura, poderá reclamar os seus prémios."],
12794=>["Value"=>12794,"TextKey"=>"新手引导说明1074","TextValue"=>"<line-height=130%> Quantas mais estrelas obtiver em níveis, mais prémios terá."],
12795=>["Value"=>12795,"TextKey"=>"新手引导说明2235","TextValue"=>"<line-height=130%>Veja! Está mesmo ali no mapa! Desbloqueie-o e veja!"],
12796=>["Value"=>12796,"TextKey"=>"新手引导说明2310","TextValue"=>"<line-height=130%>O nosso Escuteiro encontrou um novo local óptimo para um novo Campo, vá ver!"],
12797=>["Value"=>12797,"TextKey"=>"新手引导说明2315","TextValue"=>"<line-height=130%>Talvez possámos conhecer alguém bem interessante aqui!"],
12798=>["Value"=>12798,"TextKey"=>"新手引导说明2320","TextValue"=>"<line-height=130%>Bem-vindo ao <color=#46bb83>Evento Escapadela de Inverno</color>, um mundo maravilhoso espera-o!"],
