12811=>["Value"=>12811,"TextKey"=>"新手引导说明3203","TextValue"=>"<line-height=130%>Há várias <color=#f58c26>Tarefas Diárias</color> para si todos os dias. Será recompensado cada vez que completar uma delas."],
12812=>["Value"=>12812,"TextKey"=>"新手引导说明3205","TextValue"=>"<line-height=130%> Se completar todas as <color=#f58c26>Tarefas Diárias</color>, irá obter um <color=#f58c26>Prémio Extra</color>! "],
