13611=>["Value"=>13611,"TextKey"=>"攻击过程文字1035","TextValue"=>"Perecer na tempestade."],
13612=>["Value"=>13612,"TextKey"=>"攻击过程文字1036","TextValue"=>"Desaparecer em relâmpagos."],
13613=>["Value"=>13613,"TextKey"=>"攻击过程文字1037","TextValue"=>"Experimente esta combinação de festa esmagadora!"],
