13615=>["Value"=>13615,"TextKey"=>"攻击过程文字1039","TextValue"=>"Temos de proteger o lar..."],
13616=>["Value"=>13616,"TextKey"=>"天气雷名称100001","TextValue"=>"Relâmpago"],
13617=>["Value"=>13617,"TextKey"=>"天气雷描述100001","TextValue"=>"Coloque um relâmpago em cima de um objecto para arrastar os mesmos juntos."],
13618=>["Value"=>13618,"TextKey"=>"剧情ID1010101","TextValue"=>"<line-height=130%>Olá meu chefe, sou Tristan, o seu batedor! Estou feliz por todos termos sobrevivido a essa viagem acidentada. Finalmente chegámos a terra, por isso vamos montar um <color=#f58c26>Acampamento</color>. "],
13619=>["Value"=>13619,"TextKey"=>"剧情ID1010102","TextValue"=>"<line-height=130%>Isto é bastante exuberante! Não sabe o que podemos encontrar aqui? Comecemos por montar a nossa tenda para nos protegermos!"],
13620=>["Value"=>13620,"TextKey"=>"剧情ID1010201","TextValue"=>"<line-height=130%>Meu Deus, veja esta terra feia... e esta tenda feia! Tenho tantas saudades de casa..."],
13621=>["Value"=>13621,"TextKey"=>"剧情ID1010202","TextValue"=>"Então, Enda, eu sei que sair de casa é difícil, mas a única maneira de a salvar era partir. Todos aqueles desastres bizarros... temos de encontrar uma resposta! Foi por isso que pensámos em procurar ajuda."],
13622=>["Value"=>13622,"TextKey"=>"剧情ID1010203","TextValue"=>"<line-height=130%> Mas vamos encontrar uma forma de voltar, ok? Vamos começar por construir um <color=#f58c26>Altar</color> para falar com Deus, que acha, padre Enda? O chefe vai ajudar!"],
13623=>["Value"=>13623,"TextKey"=>"剧情ID1020101","TextValue"=>"<line-height=130%>Olhe o que encontrei!<color=#ef933d> Herança da Natureza</color>! É tudo de que precisamos para o <color=#f58c26>Altar</color>, e encontrámos uma forma de nos libertarmos desses totens! Este lugar é abençoado!"],
13624=>["Value"=>13624,"TextKey"=>"剧情ID1020201","TextValue"=>"<line-height=130%>Suponho que não seja completamente inútil, Stan ou algo assim. Apesar de ser muito mais pequeno e pior do que o que eu tinha em casa. Será suficiente por agora! Agora saia!"],
13625=>["Value"=>13625,"TextKey"=>"剧情ID1020202","TextValue"=>"<line-height=130%>Aww, que doce, veja como ela está feliz e a sua forma muito retorcida de dizer obrigada!"],
13626=>["Value"=>13626,"TextKey"=>"剧情ID1020203","TextValue"=>"<line-height=130%> (terminou uma dança estranha) O nosso deus disse-me que estamos no lugar certo e que uma grande figura virá em nosso auxílio..."],
13627=>["Value"=>13627,"TextKey"=>"剧情ID1020204","TextValue"=>"<line-height=130%>A sério? Isso são ótimas notícias! Quando iremos conhecer essa grande figura?"],
13628=>["Value"=>13628,"TextKey"=>"剧情ID1020301","TextValue"=>"<line-height=130%>São vocês os patifes que perturbaram o meu sono?! "],
13629=>["Value"=>13629,"TextKey"=>"剧情ID1020302","TextValue"=>"<line-height=130%>…... E você é?"],
13630=>["Value"=>13630,"TextKey"=>"剧情ID1020303","TextValue"=>"<line-height=130%>Eu sou o Arquiddruid, pai dos bardos, conquistador da tempestade, protetor dos aventureiros, mensageiro aterrador de Deus, executor e juiz, o cantor de Amergin! "],
13631=>["Value"=>13631,"TextKey"=>"剧情ID1020304","TextValue"=>"<line-height=130%>Ah... Prazer em conhecê-lo, suponho? Somos novos na área e acabámos de ouvir..."],
13632=>["Value"=>13632,"TextKey"=>"剧情ID1020305","TextValue"=>"<line-height=130%>O quê?! Vocês são invasores?! Não terão qualquer hipótese de destruir a nossa casa e separar as nossas famílias! "],
13633=>["Value"=>13633,"TextKey"=>"剧情ID1020401","TextValue"=>"O quê? Não, não! Não somos invasores, estamos apenas a tentar encontrar um lugar para descansar, e talvez resolver o mistério da nossa Terra-mãe......"],
13634=>["Value"=>13634,"TextKey"=>"剧情ID1020402","TextValue"=>"Não! A ponte! Vejam o que fizeram! Deus vai ficar furioso! Espere...Quem disse que era? Amergin? Amergin, o Arquiduque? Das Lendas?!"],
13635=>["Value"=>13635,"TextKey"=>"剧情ID1020403","TextValue"=>"Vocês não são...... invasores? Quem são vocês? Porque é que estão aqui? Espere...Porque estou aqui, e que lugar é este? Onde está o meu povo? Não me lembro desta terra..."],
13636=>["Value"=>13636,"TextKey"=>"剧情ID1020404","TextValue"=>"Lamento muito, mas também não sabemos responder. Viajámos para longe, arriscámos as nossas vidas para chegar aqui, tentando encontrar quem nos pudesse resolver o mistério da nossa Terra-mãe. Primeiro caiu sobre nós um denso nevoeiro, depois..."],
13637=>["Value"=>13637,"TextKey"=>"剧情ID1020405","TextValue"=>"Tivemos mais inundações no último ano do que na última década. No entanto, curiosamente, as pessoas têm-se transformado em totens sem vida! Dá para acreditar?!"],
13638=>["Value"=>13638,"TextKey"=>"剧情ID1020406","TextValue"=>"Oh. Isso é....muito para assimilar. Desculpe por atacá-lo e destruir a sua ponte. Talvez eu possa ajudar na sua reconstrução?"],
13639=>["Value"=>13639,"TextKey"=>"剧情ID1020407","TextValue"=>"Amergin?! O poderoso Amergin?! O seu manto, o seu poder para comandar a tempestade... É real! Isso significa que esses contos no livro da minha família são reais!"],
13640=>["Value"=>13640,"TextKey"=>"剧情ID1020408","TextValue"=>"<line-height=130%>Trabalhadores! Recomponham-se e reconstruam essa ponte!"],
13641=>["Value"=>13641,"TextKey"=>"剧情ID1020409","TextValue"=>"<line-height=130%>Mas nós estamos feridos! Não podemos começar a construir agora! "],
13642=>["Value"=>13642,"TextKey"=>"剧情ID1020410","TextValue"=>"Eu sei exatamente o que fazer. Aprendi sobre medicina herbácea ao longo de anos de viagens. Vamos colher algumas ervas e cultivar um<color=#f58c26>Jardim de Ervas</color> aqui, como a minha forma de pedir desculpa."],
13643=>["Value"=>13643,"TextKey"=>"剧情ID1020411","TextValue"=>"Obrigado! É muito amável da sua parte. Também voltaremos a casa mais tarde para libertar os que estão presos em totens, agora que aprendemos como fazê-lo! Ótimo, vamos lá!"],
13644=>["Value"=>13644,"TextKey"=>"剧情ID1030101","TextValue"=>"<line-height=130%>Estamos de volta, e trouxemos ajudantes de casa! Vamos então construir o jardim!"],
13645=>["Value"=>13645,"TextKey"=>"剧情ID1030201","TextValue"=>"<line-height=130%>Uau, não posso dizer que não estou impressionado, você é realmente bom nisto. Este pequeno jardim é lindo. "],
13646=>["Value"=>13646,"TextKey"=>"剧情ID1030202","TextValue"=>"<line-height=130%>E muito útil também. Os trabalhadores estão agora tratados e em breve estarão prontos para reconstruir a ponte!"],
13647=>["Value"=>13647,"TextKey"=>"剧情ID1030203","TextValue"=>"<line-height=130%> Fico feliz por ajudar."],
13648=>["Value"=>13648,"TextKey"=>"剧情ID1030204","TextValue"=>"Por falar nisso, de facto, o Padre estava ainda agora a falar do quão virtuoso e conhecedor você é. O que eu estou a tentar dizer é......"],
13649=>["Value"=>13649,"TextKey"=>"剧情ID1030205","TextValue"=>"Seria uma honra se um aventureiro experiente, e uma grande figura como o senhor pudesse juntar-se a nós. Mas você é uma lenda! Nunca se iria juntar a uns estranhos esquisitos! Será que iria? Por favor? Por favor, venha connosco!!!"],
13650=>["Value"=>13650,"TextKey"=>"剧情ID1030206","TextValue"=>"<line-height=130%>Claro. Talvez seja exatamente por isso que me enviam aqui."],
13651=>["Value"=>13651,"TextKey"=>"剧情ID1030207","TextValue"=>"<line-height=130%>Eu sabia. Não vai......O QUÊ?! Vem connosco?! Oh não posso acreditar...... melhor dia da minha VIDA! "],
13652=>["Value"=>13652,"TextKey"=>"剧情ID1030208","TextValue"=>"Desculpe por isso, ela às vezes fica demasiado excitada. Então, agora que se juntou a nós, que tal organizarmos uma festa de boas-vindas para si?"],
13653=>["Value"=>13653,"TextKey"=>"剧情ID1030209","TextValue"=>"Não, estou bem sem uma festa, tenho assuntos mais urgentes a tratar. Vou procurar alguma madeira para reconstruir aquela ponte que parti."],
13654=>["Value"=>13654,"TextKey"=>"剧情ID1030210","TextValue"=>"<line-height=130%>Que homem honrado! Oh! Só de o conhecer...... melhor dia da minha VIDA!"],
13655=>["Value"=>13655,"TextKey"=>"剧情ID1040101","TextValue"=>"<line-height=130%>Você é o Chefe...certo? Obrigado pela sua ajuda lá atrás. Agora estamos prontos para reconstruir aquela ponte."],
13656=>["Value"=>13656,"TextKey"=>"剧情ID1040201","TextValue"=>"<line-height=130%> Como nova! Agora, está entusiasmado por ir falar de novo com Deus, Padre Enda?"],
13657=>["Value"=>13657,"TextKey"=>"剧情ID1040202","TextValue"=>"<line-height=130%>Mais pronto do que nunca! "],
13658=>["Value"=>13658,"TextKey"=>"剧情ID1040301","TextValue"=>"Ok, Chefe, como o padre está a reunir com o seu amado altar, podemos fazer algum trabalho...<line-height=130%>"],
13659=>["Value"=>13659,"TextKey"=>"剧情ID1040401","TextValue"=>"Ai, o que é que me fez tropeçar? Huh, estou a ver, um pedaço de <color=#38c0a5>Minério Selvagem</color> do <color=#f58c26>Altar</color>. Vocês são terrivelmente descuidados quando trabalham."],
13660=>["Value"=>13660,"TextKey"=>"剧情ID1040402","TextValue"=>"<line-height=130%> Ah ah, já sei! Temos de construir um <color=#f58c26>Armazém</color> para armazenar recursos, para que as pessoas não tropecem em materiais espalhados por todo o lado."],
13661=>["Value"=>13661,"TextKey"=>"剧情ID1050101","TextValue"=>"<line-height=130%>Temos tudo o que precisamos? Então vamos lá começar a festa! Desculpem, quero dizer o<color=#f58c26>Armazém</color>."],
13662=>["Value"=>13662,"TextKey"=>"剧情ID1050201","TextValue"=>"<line-height=130%>Parede firme, espaço bonito e grande...Grande capacidade de construção, Chefe!"],
13663=>["Value"=>13663,"TextKey"=>"剧情ID1050202","TextValue"=>"<line-height=130%>Ah......Senhor? Tem uma coisa de oito pernas mesmo atrás de si."],
13664=>["Value"=>13664,"TextKey"=>"剧情ID1050301","TextValue"=>"O quê?! Como?! O que é isto?! Parece o corpo de algum tipo de criatura que habita na água...hmm, e a pele é viscosa e elástica!"],
13665=>["Value"=>13665,"TextKey"=>"剧情ID1050302","TextValue"=>"<line-height=130%><color=#f58c26>Kraken</color>! É um <color=#f58c26>Kraken</color>! Li sobre eles nos meus livros! Deve ser um bebé daquele monstro! Porque é que existe um <color=#f58c26>Kraken</color>?!"],
13666=>["Value"=>13666,"TextKey"=>"剧情ID1050303","TextValue"=>"Não há necessidade de entrar em pânico. Primeiro, está definitivamente morto, e segundo, isto é apenas um <color=#f58c26>Polvo</color> comum encalhado."],
13667=>["Value"=>13667,"TextKey"=>"剧情ID1050304","TextValue"=>"<line-height=130%>Polvo? Nunca ouvi falar deles..."],
13668=>["Value"=>13668,"TextKey"=>"剧情ID1050305","TextValue"=>"Isso significa que vocês devem ser de terras interiores. O meu povo é nómada. Dependemos do mar. Os polvos para nós são tão comuns como as estrelas no céu nocturno."],
13669=>["Value"=>13669,"TextKey"=>"剧情ID1050306","TextValue"=>"Na verdade, venha comigo, vamos encontrar algumas cordas e ramos. Vou mostrar-vos como construir uma tenda com a pele de um polvo."],
13670=>["Value"=>13670,"TextKey"=>"剧情ID1060101","TextValue"=>"<line-height=130%>...... e isso está....feito. Ficou muito melhor na minha imaginação."],
13671=>["Value"=>13671,"TextKey"=>"剧情ID1060102","TextValue"=>"<line-height=130%>É....uh......uh......adorável!"],
13672=>["Value"=>13672,"TextKey"=>"剧情ID1060103","TextValue"=>"Desculpe. Sou mais uma pessoa de teoria do que de prática. A construção não é o meu forte. Agora......talvez precise de me deitar......"],
13673=>["Value"=>13673,"TextKey"=>"剧情ID1060104","TextValue"=>"Oh grande Amergin! Porque não vai descansar na tenda principal, e eu serei a sua companhia! Transmitiu-me a sua sabedoria, e eu estarei para sempre ao seu serviço."],
13674=>["Value"=>13674,"TextKey"=>"剧情ID1060201","TextValue"=>"Este deve ser um sonho de infância tornado realidade para o padre. Estou contente por ver aqueles dois a darem-se bem. No entanto, tudo parece um pouco estranho, não acha, chefe?"],
13675=>["Value"=>13675,"TextKey"=>"剧情ID1060202","TextValue"=>"Os anciãos disseram que aqueles que viajaram para o mar nunca tinham voltado, excepto aquele que voltou como um louco, falando de uma barreira gigantesca feita de água à borda do mundo."],
13676=>["Value"=>13676,"TextKey"=>"剧情ID1060203","TextValue"=>"<line-height=130%>No entanto, Amergin disse que eles são pessoas do mar! Nenhum povo vive no mar!"],
13677=>["Value"=>13677,"TextKey"=>"剧情ID1060204","TextValue"=>"<line-height=130%>É por isso que isto é estranho. Mas de qualquer modo, não nos fez mal nenhum. Vamos continuar com os nossos trabalhos, por agora. "],
13678=>["Value"=>13678,"TextKey"=>"剧情ID1060205","TextValue"=>"<line-height=130%>Agora que já explorou por aí, a quantidade de troféus que encontrámos é esmagadora. Alguns animais podem ajudar a levá-los para casa. E para seu conforto, devíamos construir-lhes um<color=#f58c26>Estábulo de Criação de Gado</color>."],
13679=>["Value"=>13679,"TextKey"=>"剧情ID1070101","TextValue"=>"<line-height=130%>Com bom aspeto, Chefe! Parece que estes pequenotes virão já a calhar, fantástico!"],
13680=>["Value"=>13680,"TextKey"=>"剧情ID1070102","TextValue"=>"<line-height=130%>Estamos quase a terminar as construções, embora haja uma última coisa em que preciso da vossa ajuda."],
13681=>["Value"=>13681,"TextKey"=>"剧情ID1070103","TextValue"=>"<line-height=130%>No caso de alguns mal intencionados virem arruinar o nosso campo depois de termos saído, precisamos de uma equipa de batedores profissionais para patrulhar a área e proteger o nosso trabalho aqui."],
13682=>["Value"=>13682,"TextKey"=>"剧情ID1070104","TextValue"=>"<line-height=130%>Vamos precisar de um<color=#f58c26>Ringue de treino</color>!"],
13683=>["Value"=>13683,"TextKey"=>"剧情ID1070105","TextValue"=>"<line-height=130%>Isso mesmo Kevin, um <color=#f58c26> Ringue de treino</color>. Vamos encontrar alguns materiais!"],
13684=>["Value"=>13684,"TextKey"=>"剧情ID1080101","TextValue"=>"<line-height=130%>Está pronto?"],
13685=>["Value"=>13685,"TextKey"=>"剧情ID1080102","TextValue"=>"<line-height=130%> Sim, senhor!"],
13686=>["Value"=>13686,"TextKey"=>"剧情ID1080103","TextValue"=>"<line-height=130%>O chefe terminou a preparação dos materiais, vamos começar!"],
13687=>["Value"=>13687,"TextKey"=>"剧情ID1080104","TextValue"=>"<line-height=130%>Sim, senhor! Sem problema senhor!"],
13688=>["Value"=>13688,"TextKey"=>"剧情ID1080201","TextValue"=>"<line-height=130%>Bom trabalho! E agora nós......Padre? O que é que se passa?"],
13689=>["Value"=>13689,"TextKey"=>"剧情ID1080301","TextValue"=>"Eu estava a falar com o seu Arquidruida Amergin, depois ambos adormecemos por exaustão, e ambos tivemos este estranho sonho em que uma deusa nos disse "Salvem o <color=#f58c26>Coração do Mar</color>......"."],
13690=>["Value"=>13690,"TextKey"=>"剧情ID1080302","TextValue"=>"<line-height=130%><color=#f58c26>Coração do mar</color>? O que é isso?"],
13691=>["Value"=>13691,"TextKey"=>"剧情ID1080303","TextValue"=>"Temos um conto antigo sobre uma bolha gigante no mar, protegida pela mais nova das Deusas. Nela não só animais antigos sobreviveram, como também gigantes e fadas ainda vivem. Mas é simplesmente uma história de adormecer."],
13692=>["Value"=>13692,"TextKey"=>"剧情ID1080304","TextValue"=>"<line-height=130%>Tenho de ir até ao fundo da questão. A fim de obter uma mensagem mais clara da Deusa, precisarei de uma<color=#f58c26>Poderosa Base de Runa</color>."],
13693=>["Value"=>13693,"TextKey"=>"剧情ID1080305","TextValue"=>"<line-height=130%> Entendido. Muito bem, Chefe, vamos buscar alguns minérios selvagens e construir essa base para a Enda."],
13694=>["Value"=>13694,"TextKey"=>"剧情ID1090101","TextValue"=>"<line-height=130%>Estamos quase a acabar! Temos de celebrar!"],
13695=>["Value"=>13695,"TextKey"=>"剧情ID1090102","TextValue"=>"<line-height=130%>Viva!"],
13696=>["Value"=>13696,"TextKey"=>"剧情ID1090201","TextValue"=>"<line-height=130%>Não celebrem ainda! Não consigo concentrar-me neste alvoroço!"],
13697=>["Value"=>13697,"TextKey"=>"剧情ID1090202","TextValue"=>"<line-height=130%>Eu estava a tentar restabelecer a ligação com Deus e vocês estragaram tudo, idiotas barulhentos!"],
13698=>["Value"=>13698,"TextKey"=>"剧情ID1090203","TextValue"=>"<line-height=130%>Calem a boca e deixem-me em paz!"],
13699=>["Value"=>13699,"TextKey"=>"剧情ID1090204","TextValue"=>"<line-height=130%>Ai, parece que alguém não está a ter um grande dia."],
13700=>["Value"=>13700,"TextKey"=>"剧情ID1090205","TextValue"=>"<line-height=130%>Esperem, xiu! Acho que a consigo ouvir. Isto é muito importante."],
13701=>["Value"=>13701,"TextKey"=>"剧情ID1090206","TextValue"=>"Hmm...não consigo ouvir muito bem...mas o que me parece é que... devemos dirigir-nos para norte, onde nada pode crescer, e nada pode viver. Lá encontraremos um amigo."],
13702=>["Value"=>13702,"TextKey"=>"剧情ID1090207","TextValue"=>"<line-height=130%>Ok, parece... fazível? Quero dizer, o que pode acontecer! Para Norte! "],
13703=>["Value"=>13703,"TextKey"=>"剧情ID1090208","TextValue"=>"Mas antes disso, está finalmente na hora de celebrar o nosso novo Campo! Reúnam-se, cuidado, vamos ter uma grande festa!"],
13704=>["Value"=>13704,"TextKey"=>"剧情ID1090209","TextValue"=>"<line-height=130%>Viva!"],
13705=>["Value"=>13705,"TextKey"=>"剧情ID1090301","TextValue"=>"Saímos de casa a pensar que talvez nunca mais voltássemos, no entanto encontrámos esta ilha incrível, encontrámos novos amigos, e até encontrámos formas de reanimar membros tribais que pensávamos estarem para sempre perdidos."],
13706=>["Value"=>13706,"TextKey"=>"剧情ID1090302","TextValue"=>"Por tudo isto, temos de agradecer à nossa deusa, que tem estado a cuidar de nós e a dar-nos orientação, ao nosso novo amigo, o nosso querido Amergin, que nos tem emprestado generosamente os seus incríveis conhecimentos."],
13707=>["Value"=>13707,"TextKey"=>"剧情ID1090303","TextValue"=>"Mas principalmente, Chefe, não teríamos conseguido nada disto se não se tivesse mantido forte e bondoso. Portanto, obrigado Chefe, por tudo o que fez por nós, e......uh......Padre, está a chorar?"],
13708=>["Value"=>13708,"TextKey"=>"剧情ID1090304","TextValue"=>"Eu....eu não estou...*funga* a chorar......é só......*funga* Ok, estou! Eu estou a chorar! Estão todos satisfeitos agora?! Eu adoro-o, Chefe! É o melhor Chefe!! "],
13709=>["Value"=>13709,"TextKey"=>"剧情ID1090305","TextValue"=>"Haha, creio que isso diz tudo, Chefe. Mal posso esperar para ver como será a nossa viagem em frente, e um dia, resolveremos definitivamente o mistério da nossa casa, e reconstruiremos a nossa casa."],
13710=>["Value"=>13710,"TextKey"=>"剧情ID2010101","TextValue"=>"<line-height=130%>Não se apressem rapazes, estamos quase lá......"],
13711=>["Value"=>13711,"TextKey"=>"剧情ID2010102","TextValue"=>"<line-height=130%>Deus o abençoe! Há dias que andamos no deserto, ou talvez nos possa dar um pouco de água? "],
13712=>["Value"=>13712,"TextKey"=>"剧情ID2010103","TextValue"=>"<line-height=130%>Tenham alguma paciência! Quando eu tinha a vossa idade.......Ei, o que é isto?"],
13713=>["Value"=>13713,"TextKey"=>"剧情ID2010201","TextValue"=>"<line-height=130%>WOAAAAAAH!"],
13714=>["Value"=>13714,"TextKey"=>"剧情ID2010202","TextValue"=>"<line-height=130%>Padre?!"],
13715=>["Value"=>13715,"TextKey"=>"剧情ID2010203","TextValue"=>"<line-height=130%>Oh não, está aí em baixo, meu padre? Está bem?"],
13716=>["Value"=>13716,"TextKey"=>"剧情ID2010204","TextValue"=>"<line-height=130%> Bem... ainda estou vivo.... Hm, eu acho que fui arrastado para baixo por esta... mina mágica?"],
13717=>["Value"=>13717,"TextKey"=>"剧情ID2010205","TextValue"=>"<line-height=130%>Graças a Deus que está bem, não se preocupe, faremos tudo o que estiver ao nosso alcance para o tirar daí o mais depressa possível."],
13718=>["Value"=>13718,"TextKey"=>"剧情ID2010301","TextValue"=>"<line-height=130%>Chefe, encontrei um edifício abandonado no topo de uma colina nas proximidades. Pude ver uma grande máquina de corda de palha no interior, mas está rodeada de uma confusão horrível."],
13719=>["Value"=>13719,"TextKey"=>"剧情ID2010302","TextValue"=>"<line-height=130%>Acho que é uma <color=#f58c26>Oficina Antiga</color> de algum tipo."],
13720=>["Value"=>13720,"TextKey"=>"剧情ID2010303","TextValue"=>"<line-height=130%>Podemos tentar abrir a sua porta e limpá-la para que possamos fazer uma roldana de corda e puxar o padre para fora."],
13721=>["Value"=>13721,"TextKey"=>"剧情ID2010304","TextValue"=>"<line-height=130%>Bem, parem com as conversas e vão fazer essa coisa das roldanas!"],
13722=>["Value"=>13722,"TextKey"=>"剧情ID2010305","TextValue"=>"Acalme-se padre! Está a escurecer, em breve estará um gelo aqui fora! Portanto, temos de encontrar materiais para construir primeiro uma <color=#f58c26>Tenda </color> e tentar descobrir isto depois de todos terem descansado um pouco."],
13723=>["Value"=>13723,"TextKey"=>"剧情ID2010306","TextValue"=>"<line-height=130%>Mas então e eu?! Posso congelar até à morte!"],
13724=>["Value"=>13724,"TextKey"=>"剧情ID2010307","TextValue"=>"<line-height=130%>Não se preocupe, embora a diferença de temperatura acima do solo entre o dia e a noite seja enorme, a tempratura subterrânea é sempre constante e agradável. Aguente-se aí, padre! "],
13725=>["Value"=>13725,"TextKey"=>"剧情ID2020101","TextValue"=>"No dia seguinte...."],
13726=>["Value"=>13726,"TextKey"=>"剧情ID2020201","TextValue"=>"<line-height=130%> Foi uma boa noite de sono! Como está aí em baixo, padre?"],
13727=>["Value"=>13727,"TextKey"=>"剧情ID2020202","TextValue"=>"<line-height=130%>Agradecia que gastassem as vossas energias para me tirarem daqui em vez de perguntarem como é que eu estou!"],
13728=>["Value"=>13728,"TextKey"=>"剧情ID2020203","TextValue"=>"<line-height=130%>Estamos a trabalhar nisso, só preciso de algumas ferramentas necessárias para abrir essa porta antes de prosseguir. Por favor, mantenha a calma. *Sorri*"],
13729=>["Value"=>13729,"TextKey"=>"剧情ID2020204","TextValue"=>"<line-height=130%>Espera só que eu volte aí para cima... Seu fedelho ingrato..."],
13730=>["Value"=>13730,"TextKey"=>"剧情ID2020205","TextValue"=>" <line-height=130%>Ai, os meus sentimentos estão muito feridos! Como é que interpretou mal o meu bom coração dessa maneira! Mas eu perdoo-o. O chefe e eu voltaremos de imediato!"],
13731=>["Value"=>13731,"TextKey"=>"剧情ID2030201","TextValue"=>"Ok, estamos dentro! Agora só precisamos......"],
13732=>["Value"=>13732,"TextKey"=>"剧情ID2030202","TextValue"=>"Senhor, cuidado! Atrás de si!"],
13733=>["Value"=>13733,"TextKey"=>"剧情ID2030203","TextValue"=>"Ai! De onde veio esta flecha?!"],
13734=>["Value"=>13734,"TextKey"=>"剧情ID2030204","TextValue"=>"Saiam do edifício!"],
13735=>["Value"=>13735,"TextKey"=>"剧情ID2030205","TextValue"=>"Quem está aí?"],
13736=>["Value"=>13736,"TextKey"=>"剧情ID2030206","TextValue"=>"Saiam! Seus raptores!"],
13737=>["Value"=>13737,"TextKey"=>"剧情ID2030207","TextValue"=>"Raptores? Acho que apanhou as pessoas erradas, senhora da voz...Ai, ai, ai, ai!"],
13738=>["Value"=>13738,"TextKey"=>"剧情ID2030301","TextValue"=>"Senhora da voz, estamos fora do edifício, pode explicar o que está a acontecer?"],
13739=>["Value"=>13739,"TextKey"=>"剧情ID2030302","TextValue"=>"Primeiro, o meu nome não é Senhora da Voz, eu sou a Tlachtga, caçadora de relâmpagos, filha de Mug Ruith, mãe para todas as terras, heroína para......"],
13740=>["Value"=>13740,"TextKey"=>"剧情ID2030303","TextValue"=>"<size=100%>Grande Tlachtga!!!!!!!!!!!"],
13741=>["Value"=>13741,"TextKey"=>"剧情ID2030304","TextValue"=>"O que... De onde é que esta voz.... do sopé da colina? Alguém caiu dentro dessa mina?"],
13742=>["Value"=>13742,"TextKey"=>"剧情ID2030305","TextValue"=>"Vocês três, fiquem perfeitamente quietos até eu voltar. Se eu descobrir que se moveram um único centímetro, sabem o que vai acontecer."],
13743=>["Value"=>13743,"TextKey"=>"剧情ID2030306","TextValue"=>"Sim, Senhora, nem um centímetro!"],
13744=>["Value"=>13744,"TextKey"=>"剧情ID2030401","TextValue"=>"Aí está. Um padre? O que está a fazer aí em baixo? Abri a entrada a esta mina enquanto procurava alguém, como é que está lá dentro?"],
13745=>["Value"=>13745,"TextKey"=>"剧情ID2030402","TextValue"=>"Resumindo, eu estava com os três rapazes que você apanhou, mas caí dentro desta mina. Mas isso não é importante. Está aqui! Eu previ que nos encontraríamos com um amigo que nos pode ajudar nesta terra árida, não posso acreditar que seja você!"],
13746=>["Value"=>13746,"TextKey"=>"剧情ID2030403","TextValue"=>"<line-height=130%>Amigo? Ajudar-vos? Para quê? Não são...não são raptores?"],
13747=>["Value"=>13747,"TextKey"=>"剧情ID2030404","TextValue"=>"<line-height=130%>Raptores? Não, não, não, somos apenas passageiros, numa busca para encontrar ajudantes para salvar a nossa casa! *Explica*"],
13748=>["Value"=>13748,"TextKey"=>"剧情ID2030405","TextValue"=>"Huh. Agora que o disse, a minha mãe disse que ia conhecer um grupo de pessoas como vocês...mas depois ela desapareceu... o que significa que apanhei as pessoas erradas."],
13749=>["Value"=>13749,"TextKey"=>"剧情ID2030406","TextValue"=>"<line-height=130%> Mãe?"],
13750=>["Value"=>13750,"TextKey"=>"剧情ID2030407","TextValue"=>"Esqueça isso, não é nada de especial. Suponho que os seus rapazes se meteram naquela minha armadilha a tentar pôr aquela máquina de corda a funcionar, para que o pudessem tirar daqui?"],
13751=>["Value"=>13751,"TextKey"=>"剧情ID2030408","TextValue"=>"<line-height=130%>Sim, senhora sábia, é exactamente por isso, e como acabei assim, com um só pé."],
13752=>["Value"=>13752,"TextKey"=>"剧情ID2030409","TextValue"=>"Oh meu deus, a culpa é minha, eu ajudo-o com a sua ferida mais tarde. Agora, deixe-me remover as minhas armadilhas e arranjar-lhe aquela máquina de cordas."],
13753=>["Value"=>13753,"TextKey"=>"剧情ID2030501","TextValue"=>"<line-height=130%>A máquina de corda de palha está a funcionar, óptimo trabalho, minha senhora!"],
13754=>["Value"=>13754,"TextKey"=>"剧情ID2030592","TextValue"=>"<line-height=130%>Não é nada de especial! Puxem-me para cima! Agora mesmo, imediatamente!"],
13755=>["Value"=>13755,"TextKey"=>"剧情ID2030683","TextValue"=>"<line-height=130%>Resta apenas um passo. Só precisamos de preparar a corda de palha e a roldana antes de o podermos puxar."],
13756=>["Value"=>13756,"TextKey"=>"剧情ID2030774","TextValue"=>"<line-height=130%>Sinto que me estão a atacar......*Chora*"],
13757=>["Value"=>13757,"TextKey"=>"剧情ID2040101","TextValue"=>"<line-height=130%>Meu chefe, já acabou de recolher os materiais? Não há problema em levar o seu tempo, já que Enda não está aqui, podemos finalmente ter alguma paz aqui......"],
13758=>["Value"=>13758,"TextKey"=>"剧情ID2040102","TextValue"=>"<line-height=130%>Ainda consigo ouvi-lo! Não está tudo bem!"],
13759=>["Value"=>13759,"TextKey"=>"剧情ID2040103","TextValue"=>"<line-height=130%>Ups! Não sabia que conseguia ouvir......Aha, a roldana está pronta!"],
13760=>["Value"=>13760,"TextKey"=>"剧情ID2040201","TextValue"=>"<line-height=130%>Querido padre, a equipa de salvamento está em baixo, por favor torne-se visível para que não seja pisado......."],
13761=>["Value"=>13761,"TextKey"=>"剧情ID2040202","TextValue"=>"<line-height=130%>Está em cima de mim! Saia de cima de mim! "],
13762=>["Value"=>13762,"TextKey"=>"剧情ID2040203","TextValue"=>"<line-height=130%>Parece que o padre se levantará em breve, muito obrigado, minha senhora."],
13763=>["Value"=>13763,"TextKey"=>"剧情ID2040204","TextValue"=>"<line-height=130%>Não me chame senhora, o meu nome é Tlachtga. Agora, deixe-me ver, onde é que o magoei ainda agora?"],
13764=>["Value"=>13764,"TextKey"=>"剧情ID2040205","TextValue"=>"<line-height=130%>Apanhou-me na canela, minha senhora, não, Tlachtga."],
13765=>["Value"=>13765,"TextKey"=>"剧情ID2040206","TextValue"=>"<line-height=130%>Entendido. Caçadores como eu são profissionais no tratamento de feridas. Tenho um saco de Folhas de Suculentas lá em baixo na mina. Usei-a como armazenamento. Vamos deixar crescer algumas delas e esfregar esse sumo na sua perninha gira!"],
13766=>["Value"=>13766,"TextKey"=>"剧情ID2040207","TextValue"=>"<line-height=130%> Uh... perninha... ok. Então, vamos até lá agora? "],
13767=>["Value"=>13767,"TextKey"=>"剧情ID2040208","TextValue"=>"Não, não, não, os pequenos fraquinhos vão precisar de tochas para ver lá em baixo. É muito mais profundo do que se pensa. Vão procurar algumas tochas e ferramentas de escavação!"],
13768=>["Value"=>13768,"TextKey"=>"剧情ID2050101","TextValue"=>"<line-height=130%>Segure isto, se o fogo se apagar, pare e volte para trás, ok?"],
13769=>["Value"=>13769,"TextKey"=>"剧情ID2050102","TextValue"=>"<line-height=130%>Pronto? Vamos lá! Atenção aos pés!"],
13770=>["Value"=>13770,"TextKey"=>"剧情ID2050103","TextValue"=>"<line-height=130%>Sim, Senhora!"],
13771=>["Value"=>13771,"TextKey"=>"剧情ID2050104","TextValue"=>"Chefe, obrigado por ficar aqui em cima com o Padre e eu. Estou bastante triste por não poder ir, mas a Tlachtga disse que é melhor eu ficar aqui em cima para não perder a minha perna. Mas estou tão entusiasmado para ver o que nos trarão!"],
13772=>["Value"=>13772,"TextKey"=>"剧情ID2050105","TextValue"=>"<line-height=130%>Não posso acreditar que a Grande Tlachtga apenas a deixe chamá-la pelo nome. Que honra! E não mostra um pouco de gratidão..."],
13773=>["Value"=>13773,"TextKey"=>"剧情ID2050201","TextValue"=>"<line-height=130%>Oh meu senhor, o que é isso?"],
13774=>["Value"=>13774,"TextKey"=>"剧情ID2050202","TextValue"=>"<line-height=130%>É um rio subterrâneo! Não acredito que a nossa equipa encontrou um<color=#f58c26> rio subterrâneo</color>! Agora temos água!"],
13775=>["Value"=>13775,"TextKey"=>"剧情ID2050203","TextValue"=>"<line-height=130%>E encharcado."],
13776=>["Value"=>13776,"TextKey"=>"剧情ID2050204","TextValue"=>"<line-height=130%>Seus pequenos bebés, tenham paciência! É apenas um pouco de água! "],
13777=>["Value"=>13777,"TextKey"=>"剧情ID2050205","TextValue"=>"Ei, Chefe, agora que tem água, podemos cultivar algumas suculentas! Uma folha suculenta mais alguns cânticos e cuidados adequados, e terá uma suculenta em pouco tempo!"],
13778=>["Value"=>13778,"TextKey"=>"剧情ID2050206","TextValue"=>"<line-height=130%>Estas senhoras são todas suas, peça-lhes que procurem alguns baldes, pás e fertilizantes. Vou esperar aqui mesmo."],
13779=>["Value"=>13779,"TextKey"=>"剧情ID2060101","TextValue"=>"<line-height=130%>Muito bem! Feito, vejam como é giro! Pegue num pedaço, um grande."],
13780=>["Value"=>13780,"TextKey"=>"剧情ID2060102","TextValue"=>"<line-height=130%>Nunca tinha visto este tipo de planta antes...... O quê? Pegue num pedaço, diz você?"],
13781=>["Value"=>13781,"TextKey"=>"剧情ID2060103","TextValue"=>"<line-height=130%>Sim, pegue numa folha, esprema o seu sumo, esfregue-a na sua pele ferida."],
13782=>["Value"=>13782,"TextKey"=>"剧情ID2060104","TextValue"=>"<line-height=130%>Ok......Pegue num pedaço......Esfregue......Uau, funcionou mesmo! Nunca ouvi falar de nenhuma erva que possa curar feridas tão depressa!"],
13783=>["Value"=>13783,"TextKey"=>"剧情ID2060105","TextValue"=>"As pessoas chamam-me mãe de todas as terras. Presumo que o nome venha do meu extremamente impressionante Polegar Verde. Estas não são suculentas normais. Eu mesma as criei."],
13784=>["Value"=>13784,"TextKey"=>"剧情ID2060106","TextValue"=>"<line-height=130%>Milagreiar! Agora sinto que podemos resolver o mistério da nossa casa em pouco tempo! "],
13785=>["Value"=>13785,"TextKey"=>"剧情ID2060107","TextValue"=>"Na verdade, sobre isso, preciso mesmo de dormir uma sesta agora que a minha energia está esgotada. Importa-se que eu vá dormir uma sesta naquela sua «Casa"? É um Campo Base? Tem uma cama?"],
13786=>["Value"=>13786,"TextKey"=>"剧情ID2060108","TextValue"=>"Sim, é como uma espécie de Campo Base, e aqui está o mapa que fizemos para voltar atrás. Mas...... está a planear apenas fazer uma dormida ou vai juntar-se a nós?"],
13787=>["Value"=>13787,"TextKey"=>"剧情ID2060109","TextValue"=>"<line-height=130%>É claro que me junto a vocês! É estúpido?! Precisam de ajuda, eu não estou a fazer nada, porque não? Provavelmente estamos atrás da mesma pessoa de qualquer maneira. Por isso! Eu levo esse mapa, adeusinho!"],
13788=>["Value"=>13788,"TextKey"=>"剧情ID2060201","TextValue"=>"E lá vai ela. Tenho a sensação de que ela vai ser uma grande amiga do nosso povo. Vamos, então, acabar de construir o nosso acampamento. Tal como o nosso antigo Campo, precisamos de um<color=#f58c26>Armazém</color> para armazenar os materiais."],
13789=>["Value"=>13789,"TextKey"=>"剧情ID2060202","TextValue"=>"<line-height=130%>Vamos colher alguns materiais para o <color=#f58c26>Armazém</color>!"],
13790=>["Value"=>13790,"TextKey"=>"剧情ID2070101","TextValue"=>"<line-height=130%>Bom trabalho! "],
13791=>["Value"=>13791,"TextKey"=>"剧情ID2070102","TextValue"=>"<line-height=130%>Ainda não me agradeceu por o ter conduzido à água! Eu disse-lhe que estava certo sobre este lugar!"],
13792=>["Value"=>13792,"TextKey"=>"剧情ID2070103","TextValue"=>"<line-height=130%>Muito bem, muito bem. Respeitarei plenamente a sua adivinhação no futuro e satisfazerei cada um dos seus pedidos irracionais. Agora, de que precisa a seguir?"],
13793=>["Value"=>13793,"TextKey"=>"剧情ID2070104","TextValue"=>"<line-height=130%>Você...! Esqueça! Tenho a agradecer a Deus de novo para ele nos dizer onde ir a seguir. Desta vez precisarei de uma <color=#f58c26>Torre de Vigilância</color> para experimentar a Astrologia. "],
13794=>["Value"=>13794,"TextKey"=>"剧情ID2070105","TextValue"=>"<line-height=130%>Porquê a Astrologia? Nem sequer temos a certeza do que são essas estrelas, quer dizer, são apenas pontos brilhantes no céu!"],
13795=>["Value"=>13795,"TextKey"=>"剧情ID2070106","TextValue"=>"<line-height=130%>Não nos resta tempo! Temos toneladas de trabalho para fazer! Pare com as suas tolices absurdas!"],
13796=>["Value"=>13796,"TextKey"=>"剧情ID2070107","TextValue"=>"<line-height=130%>Vá recolher o material de que precisamos e volte o mais depressa possível!"],
13797=>["Value"=>13797,"TextKey"=>"剧情ID2070108","TextValue"=>"<line-height=130%>Está bem, então..."],
13798=>["Value"=>13798,"TextKey"=>"剧情ID2070201","TextValue"=>"<line-height=130%>Os adultos disseram-me para não me meter com os mais velhos, porque é que nunca prestei atenção......"],
13799=>["Value"=>13799,"TextKey"=>"剧情ID2080101","TextValue"=>"<line-height=130%> Ok, meu Chefe, acabou o seu trabalho, e a única coisa que falta é a <color=#f58c26>Torre de Vigilância</color> que o padre me pediu para construir...."],
13800=>["Value"=>13800,"TextKey"=>"剧情ID2080102","TextValue"=>"<line-height=130%>Consigo ouvir-te, seu sacana! Para de reclamar e faz o teu trabalho!"],
13801=>["Value"=>13801,"TextKey"=>"剧情ID2080103","TextValue"=>"<line-height=130%>Ok~ok~*Suspira*"],
13802=>["Value"=>13802,"TextKey"=>"剧情ID2080201","TextValue"=>"<line-height=130%>Ok meu chefe, eu vou falar com os deuses."],
13803=>["Value"=>13803,"TextKey"=>"剧情ID2080202","TextValue"=>"<line-height=130%>Pode relaxar um pouco, vemo-nos daqui a pouco."],
13804=>["Value"=>13804,"TextKey"=>"剧情ID2080203","TextValue"=>"<line-height=130%>*Sussurra* Aqui, chefe, aqui...."],
13805=>["Value"=>13805,"TextKey"=>"剧情ID2080204","TextValue"=>"<line-height=130%>Enda pode finalmente parar por um momento."],
13806=>["Value"=>13806,"TextKey"=>"剧情ID2080205","TextValue"=>"<line-height=130%>A nossa equipa encontrou uma pilha de ouro e minérios lá em baixo na mina."],
13807=>["Value"=>13807,"TextKey"=>"剧情ID2080206","TextValue"=>"<line-height=130%>Estamos a pensar em fazer um cofre para os transportar até aqui, por isso estamos aqui à procura da vossa ajuda."],
13808=>["Value"=>13808,"TextKey"=>"剧情ID2080207","TextValue"=>"<line-height=130%>Importa-se de recolher alguns materiais para fazer esse cofre?"],
13809=>["Value"=>13809,"TextKey"=>"剧情ID2090101","TextValue"=>"<line-height=130%>Ufaaa, isso era muito ouro. "],
13810=>["Value"=>13810,"TextKey"=>"剧情ID2090102","TextValue"=>"<line-height=130%>O que é isto? Está a brilhar..."],
13811=>["Value"=>13811,"TextKey"=>"剧情ID2090201","TextValue"=>"<line-height=130%>É um pequeno pacote...diz "come-me". E dentro dele, há uma<color=#f58c26>Semente Brilhante</color>? Isso significa, tipo, comer a semente?"],
13812=>["Value"=>13812,"TextKey"=>"剧情ID2090202","TextValue"=>"<line-height=130%>Deixe isso comigo!"],
13813=>["Value"=>13813,"TextKey"=>"剧情ID2090203","TextValue"=>"<line-height=130%> O quê?! Padre, que está a fazer?!"],
13814=>["Value"=>13814,"TextKey"=>"剧情ID2090301","TextValue"=>"<line-height=130%>Acabou de o comer?! Ainda não descobrimos o que é!"],
13815=>["Value"=>13815,"TextKey"=>"剧情ID2090302","TextValue"=>"O padrão de estrelas alinhou-se para apontar para o <color=#f58c26>Grande Desfiladeiro</color> a <color=#f58c26>Sudeste</color>, e a <color=#f58c26>semente sedativa</color> vai ajudar-me a encontrar o Grande...*ressona*"],
13816=>["Value"=>13816,"TextKey"=>"剧情ID2090303","TextValue"=>"<line-height=130%> Padre? Padre? Ainda está aí?"],
13817=>["Value"=>13817,"TextKey"=>"剧情ID2090304","TextValue"=>"<line-height=130%>*ressona*"],
13818=>["Value"=>13818,"TextKey"=>"剧情ID2090305","TextValue"=>"<line-height=130%>E ela adormeceu. Não consigo entender estas pessoas com poderes misteriosos. Por vezes, parecem tão estranhas. "],
13819=>["Value"=>13819,"TextKey"=>"剧情ID2090306","TextValue"=>"<line-height=130%> Uh, então onde devemos ir a seguir agora que o padre adormeceu?"],
13820=>["Value"=>13820,"TextKey"=>"剧情ID2090307","TextValue"=>"<line-height=130%> Ela falou do <color=#f58c26>Grande Desfiladeiro</color>, certo? A <color=#f58c26>Sudeste</color>?"],
13821=>["Value"=>13821,"TextKey"=>"剧情ID2090308","TextValue"=>"<line-height=130%>Devemos confiar nela? Ela parece um pouco...não ela própria neste momento?"],
13822=>["Value"=>13822,"TextKey"=>"剧情ID2090309","TextValue"=>"Sim, prometi confiar nela no futuro. Além disso, onde podemos ir a seguir de qualquer forma? Vamos descansar por hoje, e vamos para sudeste amanhã."],
13823=>["Value"=>13823,"TextKey"=>"剧情ID3010101","TextValue"=>"<line-height=130%> Ei, você!"],
13824=>["Value"=>13824,"TextKey"=>"剧情ID3010102","TextValue"=>"Eu?"],
13825=>["Value"=>13825,"TextKey"=>"剧情ID3010103","TextValue"=>"Sim! Você. Importa-se de dar uma mãozinha a uma velhinha?"],
13826=>["Value"=>13826,"TextKey"=>"剧情ID3010104","TextValue"=>"Err...Eu não estou realmente aqui."],
13827=>["Value"=>13827,"TextKey"=>"剧情ID3010105","TextValue"=>"Uh, então porquê?"],
13828=>["Value"=>13828,"TextKey"=>"剧情ID3010106","TextValue"=>"Estou neste momento com as pessoas da minha tribo. Estamos numa viagem em busca de heróis que nos possam ajudar a resolver o mistério da nossa casa."],
13829=>["Value"=>13829,"TextKey"=>"剧情ID3010107","TextValue"=>"Estou a ver. Estou mesmo a falar com a sua alma, através desse pequeno bloco brilhante na sua mão?"],
13830=>["Value"=>13830,"TextKey"=>"剧情ID3010108","TextValue"=>"O meu.... <color=#f58c26>telemóvel</color>?"],
13831=>["Value"=>13831,"TextKey"=>"剧情ID3010109","TextValue"=>"Sim, exato. O <color=#f58c26>"meu telemóvel"</color>. Pode ajudar-me?"],
13832=>["Value"=>13832,"TextKey"=>"剧情ID3010110","TextValue"=>"Espere... porque me consegue *cheirar* ?"],
13833=>["Value"=>13833,"TextKey"=>"剧情ID3010111","TextValue"=>"Ó minha querida criatura, embora tenha um olho cego, continuo a sentir tudo. Vai compreender mais tarde. Agora, pode ajudar-me?"],
13834=>["Value"=>13834,"TextKey"=>"剧情ID3010112","TextValue"=>"Ok, de que precisa?"],
13835=>["Value"=>13835,"TextKey"=>"剧情ID3010113","TextValue"=>"A sua tribo vai passar, certo? Finjo que estou a precisar desesperadamente de comida, e proponho uma <color=#f58c26>Pequena Bancada</color> para vender o meu lixo? OMG, plano maravilhoso!"],
13836=>["Value"=>13836,"TextKey"=>"剧情ID3010114","TextValue"=>"Não entendo...."],
13837=>["Value"=>13837,"TextKey"=>"剧情ID3010115","TextValue"=>"Eu não quero ajudar pessoas rudes aleatórias, certo? Têm de ser simpáticos para obterem a minha ajuda."],
13838=>["Value"=>13838,"TextKey"=>"剧情ID3010116","TextValue"=>"E?"],
13839=>["Value"=>13839,"TextKey"=>"剧情ID3010117","TextValue"=>"Se comprarem as minhas coisas e me derem comida, não há problema. Ou se me derem comida diretamente, ainda melhor!"],
13840=>["Value"=>13840,"TextKey"=>"剧情ID3010118","TextValue"=>"Caso contrário? Um estalar de dedos e a sua tribo deixará de existir. Percebeu? Por isso, vá reunir alguns materiais para mim!"],
13841=>["Value"=>13841,"TextKey"=>"剧情ID3020101","TextValue"=>"Incrível! Muito obrigado! "],
13842=>["Value"=>13842,"TextKey"=>"剧情ID3020102","TextValue"=>"Espero que a minha filha seja tão fiável e eficiente como você. "],
13843=>["Value"=>13843,"TextKey"=>"剧情ID3020103","TextValue"=>"Separámo-nos mais cedo no deserto, e eu perdi-me......O meu sentido de orientação não é assim tão bom. "],
13844=>["Value"=>13844,"TextKey"=>"剧情ID3020104","TextValue"=>"Sabe onde ela está agora?"],
13845=>["Value"=>13845,"TextKey"=>"剧情ID3020105","TextValue"=>"Claro que sei onde ela está! Mas ela não pode simplesmente...não me procurar! "],
13846=>["Value"=>13846,"TextKey"=>"剧情ID3020201","TextValue"=>"Isto sabe bem. Sabe? Só você e eu, a relaxar, a ter uma pequena conversa, a comentar a vida...."],
13847=>["Value"=>13847,"TextKey"=>"剧情ID3020301","TextValue"=>"Eles estão a chegar. Só precisamos de esperar."],
13848=>["Value"=>13848,"TextKey"=>"剧情ID3020302","TextValue"=>"……"],
13849=>["Value"=>13849,"TextKey"=>"剧情ID3020303","TextValue"=>"Passou muito tempo."],
13850=>["Value"=>13850,"TextKey"=>"剧情ID3020304","TextValue"=>"Vou subir a esses ossos e verificar onde estão."],
13851=>["Value"=>13851,"TextKey"=>"剧情ID3020401","TextValue"=>"Ha! Eles estão totalmente lá! Aquele vosso pequeno padre irresistivelmente fofo!"],
13852=>["Value"=>13852,"TextKey"=>"剧情ID3020402","TextValue"=>"Muito bem, eles estarão aqui num instante. Mal posso esperar para conhecer o seu povo! Só preciso de descer cuidadosamente......"],
13853=>["Value"=>13853,"TextKey"=>"剧情ID3020501","TextValue"=>"Está bem?"],
13854=>["Value"=>13854,"TextKey"=>"剧情ID3020502","TextValue"=>"Olá?"],
13855=>["Value"=>13855,"TextKey"=>"剧情ID3020601","TextValue"=>"Um momento mais tarde"],
13856=>["Value"=>13856,"TextKey"=>"剧情ID3020701","TextValue"=>""Esfomeado, por favor compre coisas. Por favor, dê comida". Huh. Parece que alguém começou um pequeno negócio aqui."],
13857=>["Value"=>13857,"TextKey"=>"剧情ID3020702","TextValue"=>"Ah Chefe, aqui está você. O Padre Enda disse que alguém do seu sonho está aqui à nossa espera. "],
13858=>["Value"=>13858,"TextKey"=>"剧情ID3020703","TextValue"=>"Vejo aqui alguns vestígios de atividade humana, mas esta fogueira apagou-se, esta pequena cabina está prestes a desfazer-se, e não vejo ninguém por perto... Ficámos pendurados?"],
13859=>["Value"=>13859,"TextKey"=>"剧情ID3020704","TextValue"=>"De qualquer modo, vamos construir um Acampamento e passar a noite aqui, e esperar que aquela "pessoa do sonho" apareça."],
13860=>["Value"=>13860,"TextKey"=>"剧情ID3020801","TextValue"=>"Estou tão cansado...finalmente...este manto é um forno! Estou a ser assado! Tire-o!!"],
13861=>["Value"=>13861,"TextKey"=>"剧情ID3020802","TextValue"=>"Caro padre, há pouco estava a dormir bem nas costas de um camelo. Não pode dizer que está “cansado”."],
13862=>["Value"=>13862,"TextKey"=>"剧情ID3020803","TextValue"=>"A propósito, também não se pode tirar a capa. Mesmo estando agora tão quente como o hades, ainda faz frio durante a noite."],
13863=>["Value"=>13863,"TextKey"=>"剧情ID3020804","TextValue"=>"Meu Deus...porquê pedir-me para vir a este lugar desolado...e ter que aturar também este jovem arrogante..."],
13864=>["Value"=>13864,"TextKey"=>"剧情ID3020805","TextValue"=>"Por favor, seja um pouco mais paciente. O chefe irá reunir aqui os materiais de que necessitamos para construir uma <color=#f58c26>Tenda</color> aqui."],
13865=>["Value"=>13865,"TextKey"=>"剧情ID3030101","TextValue"=>"Muito bem, Chefe! Vamos começar!"],
13866=>["Value"=>13866,"TextKey"=>"剧情ID3030201","TextValue"=>"Óptimo! Creio que as pessoas já estão todas com fome. Vamos dar uso à fogueira e cozinhar alguma coisa. Comam bem, trabalhem bem!"],
13867=>["Value"=>13867,"TextKey"=>"剧情ID3030202","TextValue"=>"Viva! Comida! Bacon!"],
13868=>["Value"=>13868,"TextKey"=>"剧情ID3030203","TextValue"=>"Costeleta de borrego para mim, por favor..."],
13869=>["Value"=>13869,"TextKey"=>"剧情ID3030204","TextValue"=>"Seus carnívoros selvagens!"],
13870=>["Value"=>13870,"TextKey"=>"剧情ID3030205","TextValue"=>"Então, o que é que quer?"],
13871=>["Value"=>13871,"TextKey"=>"剧情ID3030206","TextValue"=>"Bife, médio com molho de rábano, por favor."],
13872=>["Value"=>13872,"TextKey"=>"剧情ID3030207","TextValue"=>"Padre, isso também..."],
13873=>["Value"=>13873,"TextKey"=>"剧情ID3030208","TextValue"=>"Eu sei! Xiu!"],
13874=>["Value"=>13874,"TextKey"=>"剧情ID3030209","TextValue"=>"Haha, a proteína é muito importante para um corpo em viagem. Tem sido uma viagem difícil, por isso vamos festejar! O que diz, Chefe?"],
13875=>["Value"=>13875,"TextKey"=>"剧情ID3030210","TextValue"=>"Não temos assim tanto material para cozinhar..."],
13876=>["Value"=>13876,"TextKey"=>"剧情ID3030211","TextValue"=>"Temos carne de carneiro, carne seca e maçãs, Chefe!"],
13877=>["Value"=>13877,"TextKey"=>"剧情ID3030212","TextValue"=>"Mas o Chefe tem razão, queremos guardar alguns deles para noites mais difíceis mais tarde. Por isso, precisamos de encontrar algumas proteínas alternativas."],
13878=>["Value"=>13878,"TextKey"=>"剧情ID3030213","TextValue"=>"Vi alguns lagartos do deserto. Os ovos de lagartos e eles próprios seriam grandes fontes de proteínas!"],
13879=>["Value"=>13879,"TextKey"=>"剧情ID3030214","TextValue"=>"O que é que disse?! Lagartos?! Como é que podemos comer lagartos?!"],
13880=>["Value"=>13880,"TextKey"=>"剧情ID3030215","TextValue"=>"Há todo o tipo de iguarias que podemos criar se abrirmos as nossas mentes! Por exemplo, "guisado de lagarto" soa particularmente atrativo!"],
13881=>["Value"=>13881,"TextKey"=>"剧情ID3030216","TextValue"=>"Mal posso esperar!"],
13882=>["Value"=>13882,"TextKey"=>"剧情ID3030217","TextValue"=>"Oh... caça ao lagarto..."],
13883=>["Value"=>13883,"TextKey"=>"剧情ID3040101","TextValue"=>"Incrível! Recolheu todos os materiais! Toca a andar!"],
13884=>["Value"=>13884,"TextKey"=>"剧情ID3040102","TextValue"=>"A chegar! Acendam a fogueira!"],
13885=>["Value"=>13885,"TextKey"=>"剧情ID3040201","TextValue"=>"Finalmente...Comida...Não me consigo mexer mais... Ovo Estrelado...Bife...Maçã Assada..."],
13886=>["Value"=>13886,"TextKey"=>"剧情ID3040202","TextValue"=>"Costeleta de carneiro para Arlan, Ovo estrelado para o Kevin...E o Padre Enda partilhará comigo esta taça de delicioso guisado de lagarto..."],
13887=>["Value"=>13887,"TextKey"=>"剧情ID3040301","TextValue"=>"Ninguém vai partilhar guisado de lagarto!"],
13888=>["Value"=>13888,"TextKey"=>"剧情ID3040302","TextValue"=>"Nesse caso, darei esta tigela de guisado quente, fumegante e delicioso aos nossos novos amigos."],
13889=>["Value"=>13889,"TextKey"=>"剧情ID3040303","TextValue"=>"Novos amigos? Que novos amigos?"],
13890=>["Value"=>13890,"TextKey"=>"剧情ID3040401","TextValue"=>"Ah!!! Não!!!! Tirem estes ratos de cima de mim!!!!"],
13891=>["Value"=>13891,"TextKey"=>"剧情ID3040402","TextValue"=>"São demasiado grandes para serem ratos. Segundo a minha observação, estes são Maubbits, uma espécie de roedores exclusivos de regiões áridas."],
13892=>["Value"=>13892,"TextKey"=>"剧情ID3040403","TextValue"=>"São geralmente, e surpreendentemente, tímidos considerando o seu tamanho impressionante, tornando-os completamente inofensivos para os seres humanos."],
13893=>["Value"=>13893,"TextKey"=>"剧情ID3040404","TextValue"=>"Sim, sim, já percebi! Não quero saber o que são! Tirem-nos de cima de mim!!"],
13894=>["Value"=>13894,"TextKey"=>"剧情ID3040405","TextValue"=>"Agora que o mencionou, é bastante estranho que eles não tenham medo de si......"],
13895=>["Value"=>13895,"TextKey"=>"剧情ID3040406","TextValue"=>"Caros trabalhadores, podem fazer a gentileza de retirar estas adoráveis criaturas do nosso padre?"],
13896=>["Value"=>13896,"TextKey"=>"剧情ID3040407","TextValue"=>"Certo!"],
13897=>["Value"=>13897,"TextKey"=>"剧情ID3040501","TextValue"=>"Ei! Devolve isso!"],
13898=>["Value"=>13898,"TextKey"=>"剧情ID3040502","TextValue"=>"Hmm, e lá vão eles. Parece que ainda têm medo de todos menos do padre."],
13899=>["Value"=>13899,"TextKey"=>"剧情ID3040503","TextValue"=>"Eles levaram o meu anel! O meu amado anel..."],
13900=>["Value"=>13900,"TextKey"=>"剧情ID3040504","TextValue"=>"Pobre padre, acho que podemos seguir os seus passos para dentro dos restos do dragão? Seja como for, estou bastante curioso sobre esses pequenos. "],
13901=>["Value"=>13901,"TextKey"=>"剧情ID3040505","TextValue"=>"E para isso, precisamos de um<color=#f58c26>Moinho de Vento</color> para nos ajudar a transportar pessoas para cima e para baixo, considerando o quão íngreme é aquela montanha."],
13902=>["Value"=>13902,"TextKey"=>"剧情ID3050101","TextValue"=>"Já estamos todos preparados com os materiais do <color=#f58c26>Moinho de vento</color>?! Impressionante!"],
13903=>["Value"=>13903,"TextKey"=>"剧情ID3050102","TextValue"=>"Moinho de Vento fresquinho a sair!"],
13904=>["Value"=>13904,"TextKey"=>"剧情ID3050201","TextValue"=>"Boa! Agora é muito mais seguro e conveniente subir e descer a encosta!"],
13905=>["Value"=>13905,"TextKey"=>"剧情ID3050202","TextValue"=>"Óptimo! Despachem-se e tragam o meu anel de volta! Essa coisa é sagrada!"],
13906=>["Value"=>13906,"TextKey"=>"剧情ID3050203","TextValue"=>"Ok ok estamos a ir! Kevin, Arlan, estão prontos?"],
13907=>["Value"=>13907,"TextKey"=>"剧情ID3050204","TextValue"=>"Como sempre!"],
13908=>["Value"=>13908,"TextKey"=>"剧情ID3050205","TextValue"=>"Uh......senhor......não que eu seja um cobarde, mas penso que também precisamos de cordas para o caso de cairmos do penhasco......"],
13909=>["Value"=>13909,"TextKey"=>"剧情ID3050206","TextValue"=>"Aha, tem toda a razão! A segurança no trabalho é importante! Portanto, Chefe, vá buscar algum equipamento de segurança!"],
13910=>["Value"=>13910,"TextKey"=>"剧情ID3060101","TextValue"=>"Estamos prontos agora?"],
13911=>["Value"=>13911,"TextKey"=>"剧情ID3060102","TextValue"=>"Sim!"],
13912=>["Value"=>13912,"TextKey"=>"剧情ID3060103","TextValue"=>"Lindo! Vamos resolver o mistério dos Maubbits agora mesmo! Que emocionante!"],
13913=>["Value"=>13913,"TextKey"=>"剧情ID3060104","TextValue"=>"Não se esqueçam do meu anel!"],
13914=>["Value"=>13914,"TextKey"=>"剧情ID3060201","TextValue"=>"Uau, isto é uma pilha de ossos mesmo profunda! Espera...há uma coisa cintilante no fundo...Hmm...Pode ser o anel de Enda?"],
13915=>["Value"=>13915,"TextKey"=>"剧情ID3060202","TextValue"=>"Chefe! Veja o que encontrámos! Uma mulher velha coberta de terra!"],
13916=>["Value"=>13916,"TextKey"=>"剧情ID3060203","TextValue"=>"E o anel do padre."],
13917=>["Value"=>13917,"TextKey"=>"剧情ID3060301","TextValue"=>"*Chora* Obrigado, Arlan, o mais sensato de todos nós......Espera... o quê?"],
13918=>["Value"=>13918,"TextKey"=>"剧情ID3060401","TextValue"=>"*Barulhos de entusiasmo*"],
13919=>["Value"=>13919,"TextKey"=>"剧情ID3060402","TextValue"=>"Suponho que... agradeço?"],
13920=>["Value"=>13920,"TextKey"=>"剧情ID3060403","TextValue"=>"*Barulhos Felizes*"],
13921=>["Value"=>13921,"TextKey"=>"剧情ID3060501","TextValue"=>"*Barulhos de Entusiasmo*"],
13922=>["Value"=>13922,"TextKey"=>"剧情ID3060502","TextValue"=>"Oh, olá! Olá! São tão acolhedores! Eu conheço-vos? O vosso pêlo parece-me bastante familiar..."],
13923=>["Value"=>13923,"TextKey"=>"剧情ID3060503","TextValue"=>"Oh! E tu deves ser aquele pequeno padre no meu sonho! És ainda mais bonito na vida real!"],
13924=>["Value"=>13924,"TextKey"=>"剧情ID3060504","TextValue"=>"Pequeno? Como te atreves a chamar-me pequeno? Sou o nobre mensageiro de Deus..."],
13925=>["Value"=>13925,"TextKey"=>"剧情ID3060505","TextValue"=>"Desculpe, disse que sonhou com o nosso padre?"],
13926=>["Value"=>13926,"TextKey"=>"剧情ID3060506","TextValue"=>"Oh~ Jovem! Sim! Sonhei em contar ao seu pequeno padre: "Estarei à sua espera". Mas não sei o que isso significa de todo!"],
13927=>["Value"=>13927,"TextKey"=>"剧情ID3060507","TextValue"=>"O que quer dizer com isso?!"],
13928=>["Value"=>13928,"TextKey"=>"剧情ID3060508","TextValue"=>"Na verdade, isto é engraçado. Não me lembro de todo do meu nome, por isso não sei o que significa esse estranho sonho. "],
13929=>["Value"=>13929,"TextKey"=>"剧情ID3060509","TextValue"=>"Devo ter batido com a cabeça com bastante força enquanto caí no poço. Ainda vacilo um pouco quando ando. "],
13930=>["Value"=>13930,"TextKey"=>"剧情ID3060510","TextValue"=>"Esta pequena bancada aqui é sua? Diz " Esfomeado, por favor compre as minhas coisas. Por favor, dê comida"?"],
13931=>["Value"=>13931,"TextKey"=>"剧情ID3060511","TextValue"=>"Dado que o que está escrito nesta banca me descreve com precisão, e já que estamos no meio de um deserto, sim, acho que é meu."],
13932=>["Value"=>13932,"TextKey"=>"剧情ID3060512","TextValue"=>"Oh! Sem preocupações! Temos comida. Por favor, aproveite-a na nossa tenda."],
13933=>["Value"=>13933,"TextKey"=>"剧情ID3060513","TextValue"=>"Isso seria fantástico!"],
13934=>["Value"=>13934,"TextKey"=>"剧情ID3060514","TextValue"=>"Oh, mais uma coisa, cheira-me a bacon, maçã assada, e.....<color=#f58c26>uma tempestade iminente </color>no ar. É melhor prepararem-se. "],
13935=>["Value"=>13935,"TextKey"=>"剧情ID3060601","TextValue"=>"E......lá vai ela. Muito bem então, Chefe, tenho a certeza que já ouviu falar, o vento é forte e louco aqui, deixe-me ver......"],
13936=>["Value"=>13936,"TextKey"=>"剧情ID3060602","TextValue"=>"A nossa tenda precisa de algum reforço na parte superior para fazer peso."],
13937=>["Value"=>13937,"TextKey"=>"剧情ID3060603","TextValue"=>"Porque é que temos de a ouvir! Não sabemos de onde ela é, e você acredita no que ela diz! "],
13938=>["Value"=>13938,"TextKey"=>"剧情ID3060604","TextValue"=>"As minhas previsões...... você escolhe sempre um erro e ridiculariza-me vezes sem conta! Vou descobrir as verdadeiras cores daquela mulher, espere e verá!"],
13939=>["Value"=>13939,"TextKey"=>"剧情ID3060605","TextValue"=>"Ooooh, alguém está a tornar-se competitivo. De qualquer forma, Chefe, fiz a lista dos materiais necessários para <color=#f58c26>reforçar a tenda</color>, por favor dê uma vista de olhos."],
13940=>["Value"=>13940,"TextKey"=>"剧情ID3070101","TextValue"=>"Hm, bom chá."],
13941=>["Value"=>13941,"TextKey"=>"剧情ID3070102","TextValue"=>"E esta bolacha também é bastante agradável, derrete-se na boca. Embora esteja um pouco queimada no exterior. "],
13942=>["Value"=>13942,"TextKey"=>"剧情ID3070103","TextValue"=>"Pode baixar a temperatura da próxima vez e cozê-la por um tempo mais longo."],
13943=>["Value"=>13943,"TextKey"=>"剧情ID3070104","TextValue"=>"Porque está ela a tomar um chá da tarde?!"],
13944=>["Value"=>13944,"TextKey"=>"剧情ID3070105","TextValue"=>"O que é que tem?"],
13945=>["Value"=>13945,"TextKey"=>"剧情ID3070106","TextValue"=>"E que sotaque britânico estranho é aquele?! Nem estamos na era certa!"],
13946=>["Value"=>13946,"TextKey"=>"剧情ID3070107","TextValue"=>"Relaxe, pequeno padre. Vai correr tudo bem. Vai compreender."],
13947=>["Value"=>13947,"TextKey"=>"剧情ID3070108","TextValue"=>"Não! Nada vai ficar bem! E eu não vou compreender nada! Meu Deus...de onde raio veio esta mulher......"],
13948=>["Value"=>13948,"TextKey"=>"剧情ID3070109","TextValue"=>"Uma vez que pediu com a maior das sinceridades, de facto, obrigado pelo chá da tarde de que desfrutei agora mesmo......"],
13949=>["Value"=>13949,"TextKey"=>"剧情ID3070110","TextValue"=>"Penso ter recuperado algumas das minhas memórias. Na verdade, quer dizer, honestamente, de forma justa, o facto é......"],
13950=>["Value"=>13950,"TextKey"=>"剧情ID3070111","TextValue"=>"Não pode dizer logo?!"],
13951=>["Value"=>13951,"TextKey"=>"剧情ID3070112","TextValue"=>"Pode também reforçar aquela<color=#f58c26>Pequena bancada</color> lá fora para mim?"],
13952=>["Value"=>13952,"TextKey"=>"剧情ID3070113","TextValue"=>"O quê?"],
13953=>["Value"=>13953,"TextKey"=>"剧情ID3070114","TextValue"=>"Uma velha magricela como eu, que caminhou dias e dias sozinha, que construiu esta bancada a morrer de fome... oh, pobrezinha!"],
13954=>["Value"=>13954,"TextKey"=>"剧情ID3070115","TextValue"=>"Será devastador para mim se a banca cair. O meu destino está nas vossas mãos! Estou imensamente grata!"],
13955=>["Value"=>13955,"TextKey"=>"剧情ID3070116","TextValue"=>"Que senhora interessante."],
13956=>["Value"=>13956,"TextKey"=>"剧情ID3070117","TextValue"=>"O que é que disse?!"],
13957=>["Value"=>13957,"TextKey"=>"剧情ID3070118","TextValue"=>"Chefe, eu fiz a lista de materiais para si, por favor vá ver."],
13958=>["Value"=>13958,"TextKey"=>"剧情ID3070119","TextValue"=>"Não me ignore!!!!! Bolas, já não aguento mais isto!"],
13959=>["Value"=>13959,"TextKey"=>"剧情ID3080101","TextValue"=>"Lindo! Vocês são todos espantosos!"],
13960=>["Value"=>13960,"TextKey"=>"剧情ID3080102","TextValue"=>"Mãe! Eu sabia! Eu sabia que eras tu!"],
13961=>["Value"=>13961,"TextKey"=>"剧情ID3080201","TextValue"=>"Grande Tlachtga, o que é que faz aqui?!"],
13962=>["Value"=>13962,"TextKey"=>"剧情ID3080202","TextValue"=>"E esta jovem é?"],
13963=>["Value"=>13963,"TextKey"=>"剧情ID3080203","TextValue"=>"Tlachtga! A sua filha! Pare de se fazer de parva! "],
13964=>["Value"=>13964,"TextKey"=>"剧情ID3080204","TextValue"=>"O mensageiro disse-me que tinham desenterrado uma velha cega de uma pilha de ossos, soou muito parecido consigo, por isso mais valia vir verificar."],
13965=>["Value"=>13965,"TextKey"=>"剧情ID3080205","TextValue"=>"Não me surpreende nada vê-la aqui."],
13966=>["Value"=>13966,"TextKey"=>"剧情ID3080206","TextValue"=>"A mãe de Tlachtga...Nunca ouvi dizer que Tlachtga tinha uma mãe..."],
13967=>["Value"=>13967,"TextKey"=>"剧情ID3080207","TextValue"=>"Claro que eu tenho uma mãe, seu idiota!"],
13968=>["Value"=>13968,"TextKey"=>"剧情ID3080208","TextValue"=>"Cuidado com a língua!"],
13969=>["Value"=>13969,"TextKey"=>"剧情ID3080209","TextValue"=>"Seja como for, esta senhora louca aqui é Mug Ruith, mesmo à sua frente."],
13970=>["Value"=>13970,"TextKey"=>"剧情ID3080210","TextValue"=>"Podem chamar-me Meg."],
13971=>["Value"=>13971,"TextKey"=>"剧情ID3080211","TextValue"=>"Mas pensei que Mug Ruith fosse um homem..."],
13972=>["Value"=>13972,"TextKey"=>"剧情ID3080212","TextValue"=>"Bem, a minha mãe pode ser muitas coisas em contos. Ela escondeu a sua verdadeira identidade das pessoas quando eu era pequena."],
13973=>["Value"=>13973,"TextKey"=>"剧情ID3080213","TextValue"=>"Porque sabem, quem é mais suscetível de ser explorado do que uma mulher cega e uma criança de três anos?"],
13974=>["Value"=>13974,"TextKey"=>"剧情ID3080214","TextValue"=>"Acho que foi assim que a história começou a espalhar-se... um druida omnipotente que sabe tudo, um guerreiro cego, um poderoso cavaleiro..."],
13975=>["Value"=>13975,"TextKey"=>"剧情ID3080215","TextValue"=>"Embora na realidade ela seja apenas uma velha cega com um estranho sentido de humor."],
13976=>["Value"=>13976,"TextKey"=>"剧情ID3080216","TextValue"=>"Mug Ruith é uma mulher...e eu fui rude com Mug Ruith...Oh...Oh...estarei condenado...sou uma vergonha para o título de padre..."],
13977=>["Value"=>13977,"TextKey"=>"剧情ID3080217","TextValue"=>"Padrezinho, não sejas tão taciturno. Irás melhorar a simpatia~ Perdoo-te desta vez porque és tão querido!~"],
13978=>["Value"=>13978,"TextKey"=>"剧情ID3080218","TextValue"=>"Então enganou-nos? Não perdeu a sua memória?"],
13979=>["Value"=>13979,"TextKey"=>"剧情ID3080219","TextValue"=>"Sim....desculpe lá isso. Viagens longas podem ser aborrecidas, sabe? Estava apenas a divertir-me um pouco~ "],
13980=>["Value"=>13980,"TextKey"=>"剧情ID3080220","TextValue"=>"Mas ei, olhem para aquela bela tenda e aquela bela cabina! Agora isto está a começar a parecer um Acampamento! Embora ainda pareça faltar......"],
13981=>["Value"=>13981,"TextKey"=>"剧情ID3080221","TextValue"=>"O que é que falta?"],
13982=>["Value"=>13982,"TextKey"=>"剧情ID3080222","TextValue"=>"Deixa-me ver..."],
13983=>["Value"=>13983,"TextKey"=>"剧情ID3080301","TextValue"=>"Um portão! É preciso um portão para marcar a entrada do Campo, e com algumas luzes, vai ficar fabuloso como sempre!"],
13984=>["Value"=>13984,"TextKey"=>"剧情ID3080302","TextValue"=>"Seremos os seus mais humildes criados e vamos construir esse portão, minha senhora! Chefe, recomponha-se!"],
13985=>["Value"=>13985,"TextKey"=>"剧情ID3090101","TextValue"=>"Têm tudo? Óptimo! Mexam-se, mexam-se!"],
13986=>["Value"=>13986,"TextKey"=>"剧情ID3090201","TextValue"=>"Oh! que rejuvenescedor! Este é o primeiro projeto de construção que eu dirigi......"],
13987=>["Value"=>13987,"TextKey"=>"剧情ID3090202","TextValue"=>"Parabéns, Padre, você cresceu tanto. Mas não sabe se a Meg está satisfeita com o aspeto do nosso acampamento agora?"],
13988=>["Value"=>13988,"TextKey"=>"剧情ID3090203","TextValue"=>"Tudo o resto está bem, mas o céu vazio parece bastante aborrecido......"],
13989=>["Value"=>13989,"TextKey"=>"剧情ID3090204","TextValue"=>"Eu sei! Eu sei! Temos alguns balões de sinal que podem flutuar no céu!"],
13990=>["Value"=>13990,"TextKey"=>"剧情ID3090205","TextValue"=>"É uma ideia maravilhosa! Apenas que precisamos de alguns pequenos ajustes para apimentar a coisa. "],
13991=>["Value"=>13991,"TextKey"=>"剧情ID3090206","TextValue"=>"Ainda têm daquelas rochas brilhantes amarelas e cor-de-rosa?"],
13992=>["Value"=>13992,"TextKey"=>"剧情ID3090207","TextValue"=>"Sim temos!"],
13993=>["Value"=>13993,"TextKey"=>"剧情ID3090208","TextValue"=>"Incrível. Só um momento. Kevin, anda."],
13994=>["Value"=>13994,"TextKey"=>"剧情ID3090301","TextValue"=>"Ufa, isso foi algum exercício. Mas veja estes, não são tão bonitos?"],
13995=>["Value"=>13995,"TextKey"=>"剧情ID3090302","TextValue"=>"Sim, são mesmo."],
13996=>["Value"=>13996,"TextKey"=>"剧情ID3090303","TextValue"=>"Ainda bem que gosta. É raro quando a mãe faz algo normal. De qualquer modo, está a ficar tarde, vou voltar agora. "],
13997=>["Value"=>13997,"TextKey"=>"剧情ID3090304","TextValue"=>"Já vai embora?"],
13998=>["Value"=>13998,"TextKey"=>"剧情ID3090305","TextValue"=>"Sim, ou o quê? Não me vou aconchegar a vocês, homens malcheirosos, naquela vossa pequena tenda! Mãe, vens comigo?"],
13999=>["Value"=>13999,"TextKey"=>"剧情ID3090306","TextValue"=>"Apanho-te mais tarde. Os teus novos amigos parecem encantadores, especialmente este pequeno e fofo padre~! Quero passar um tempo com eles~"],
14000=>["Value"=>14000,"TextKey"=>"剧情ID3090307","TextValue"=>"Mãe, controla-te."],
14001=>["Value"=>14001,"TextKey"=>"剧情ID3090308","TextValue"=>"Eu sei que sei, agora estou bem controlada. Afinal de contas, ainda temos uma longa viagem juntos à nossa espera."],
14002=>["Value"=>14002,"TextKey"=>"剧情ID3090309","TextValue"=>"Então está bem. Até logo."],
14003=>["Value"=>14003,"TextKey"=>"剧情ID3090401","TextValue"=>"Estava a sugerir que se juntaria a nós agora mesmo?"],
14004=>["Value"=>14004,"TextKey"=>"剧情ID3090402","TextValue"=>"Claro, porque não! A vossa aventura será cada vez mais perigosa. "],
14005=>["Value"=>14005,"TextKey"=>"剧情ID3090403","TextValue"=>"Não há muito que eu possa fazer, mas pelo menos posso lançar alguma luz sobre o que ainda está por vir."],
14006=>["Value"=>14006,"TextKey"=>"剧情ID3090404","TextValue"=>"Mas preciso que me mostrem o caminho para a vossa Terra-mãe. O meu sentido de orientação é......inimaginavelmente terrível."],
14007=>["Value"=>14007,"TextKey"=>"剧情ID4010101","TextValue"=>"Ouch...Porque é que tal lugar existe na terra?! Os meus pés parecem pisar as chamas sem parar..."],
14008=>["Value"=>14008,"TextKey"=>"剧情ID4010102","TextValue"=>"Impressionante, Enda! Suspira... Há quatro horas que não falas mais do que cinco palavras."],
14009=>["Value"=>14009,"TextKey"=>"剧情ID4010103","TextValue"=>"Estou...demasiado cansada...demasiado quente..."],
14010=>["Value"=>14010,"TextKey"=>"剧情ID4010104","TextValue"=>"Bando de bebézinhos frágeis! É só um vulcão. Olhem para vocês, como se fossem deitar-se no chão!"],
14011=>["Value"=>14011,"TextKey"=>"剧情ID4010105","TextValue"=>"Senhora... Também tem estado a suar como um rio. Sente-se bem?"],
14012=>["Value"=>14012,"TextKey"=>"剧情ID4010106","TextValue"=>"Chame-me Tlachtga!... Não estou cansada, mas está mesmo muito calor aqui... o que é muito mais perigoso do que no mar."],
14013=>["Value"=>14013,"TextKey"=>"剧情ID4010107","TextValue"=>"Parece que chegámos."],
14014=>["Value"=>14014,"TextKey"=>"剧情ID4010108","TextValue"=>"Deixe-me ver! De acordo com as instruções da Deusa, há um mar em chamas com ilhas..."],
14015=>["Value"=>14015,"TextKey"=>"剧情ID4010109","TextValue"=>"Sim, deve ser aqui!"],
14016=>["Value"=>14016,"TextKey"=>"剧情ID4010110","TextValue"=>"Mas onde está o Amergin? Amergin deveria ter chegado e esperado por nós aqui. Mas ele não está em lado nenhum."],
14017=>["Value"=>14017,"TextKey"=>"剧情ID4010111","TextValue"=>"Devia construir um altar para sentir sinais do Amergin. Mas..."],
14018=>["Value"=>14018,"TextKey"=>"剧情ID4010201","TextValue"=>"Oh... Chefe, eu..."],
14019=>["Value"=>14019,"TextKey"=>"剧情ID4010202","TextValue"=>"Enda!"],
14020=>["Value"=>14020,"TextKey"=>"剧情ID4010203","TextValue"=>"Enda!"],
14021=>["Value"=>14021,"TextKey"=>"剧情ID4010204","TextValue"=>"Ela deve ter um ataque de calor! Rápido! Construa uma sombra para que ela descanse!"],
14022=>["Value"=>14022,"TextKey"=>"剧情ID4020101","TextValue"=>"Senhor, a construção está concluída!"],
14023=>["Value"=>14023,"TextKey"=>"剧情ID4020102","TextValue"=>"Deusa, parece que consigo viver um pouco mais..."],
14024=>["Value"=>14024,"TextKey"=>"剧情ID4020103","TextValue"=>"Está de facto demasiado calor! Tenho tantas saudades do cheiro do mar..."],
14025=>["Value"=>14025,"TextKey"=>"剧情ID4020104","TextValue"=>"Phew, o nosso padre está com muito melhor aspeto."],
14026=>["Value"=>14026,"TextKey"=>"剧情ID4020105","TextValue"=>"É um pouco melhor ter uma tenda a proteger-nos de ar quente avassalador..."],
14027=>["Value"=>14027,"TextKey"=>"剧情ID4020106","TextValue"=>"Mas só um bocadinho."],
14028=>["Value"=>14028,"TextKey"=>"剧情ID4020107","TextValue"=>"Vossa deusa sagrada! Por favor, virai-me, para que eu possa ser grelhada uniformemente..."],
14029=>["Value"=>14029,"TextKey"=>"剧情ID4020108","TextValue"=>"Devo dizer que isto aqui parece mesmo um grande fogão."],
14030=>["Value"=>14030,"TextKey"=>"剧情ID4020109","TextValue"=>"Vejam! As terras baixas ali!"],
14031=>["Value"=>14031,"TextKey"=>"剧情ID4020110","TextValue"=>"Contemplem! A minha mãe deu à luz, literalmente, um génio."],
14032=>["Value"=>14032,"TextKey"=>"剧情ID4030101","TextValue"=>"Fantástico Tlachtga! Isso é água! ÁGUA!"],
14033=>["Value"=>14033,"TextKey"=>"剧情ID4030102","TextValue"=>"Hah, eu pensava que o nosso piedoso sacerdote tinha visto a Deusa."],
14034=>["Value"=>14034,"TextKey"=>"剧情ID4030103","TextValue"=>"Voltei à vida e estou a sentir-me muito bem!"],
14035=>["Value"=>14035,"TextKey"=>"剧情ID4030104","TextValue"=>"Vejo que vocês estão de facto mais enérgicos!"],
14036=>["Value"=>14036,"TextKey"=>"剧情ID4030105","TextValue"=>"Neste caso... você, você e você, apressem-se e vão construir um Anel de Treino!"],
14037=>["Value"=>14037,"TextKey"=>"剧情ID4030106","TextValue"=>"Anel de Treino?"],
14038=>["Value"=>14038,"TextKey"=>"剧情ID4030107","TextValue"=>"Sim, correto!"],
14039=>["Value"=>14039,"TextKey"=>"剧情ID4030108","TextValue"=>"Não devíamos estar à procura do Amergin?"],
14040=>["Value"=>14040,"TextKey"=>"剧情ID4030109","TextValue"=>"Amergin... aquele velhote. Sei que ele consegue controlar as forças da natureza como se não fosse nada."],
14041=>["Value"=>14041,"TextKey"=>"剧情ID4030110","TextValue"=>"De volta a vocês, caminhar até aqui levou literalmente metade das vossas vidas. Como podemos deixar para trás o treino físico?"],
14042=>["Value"=>14042,"TextKey"=>"剧情ID4030111","TextValue"=>"Bem, a Enda precisa mesmo de mais exercício."],
14043=>["Value"=>14043,"TextKey"=>"剧情ID4030112","TextValue"=>"Cala-te!"],
14044=>["Value"=>14044,"TextKey"=>"剧情ID4030113","TextValue"=>"De acordo com a profecia da minha mãe, só haverá tempestades mais fortes à nossa espera..."],
14045=>["Value"=>14045,"TextKey"=>"剧情ID4030114","TextValue"=>"A profecia de Mug Ruith..."],
14046=>["Value"=>14046,"TextKey"=>"剧情ID4030115","TextValue"=>"Jovem!"],
14047=>["Value"=>14047,"TextKey"=>"剧情ID4030116","TextValue"=>"Entendido!"],
14048=>["Value"=>14048,"TextKey"=>"剧情ID4040101","TextValue"=>"Veja o planalto no norte! Na verdade, existe uma escada natural."],
14049=>["Value"=>14049,"TextKey"=>"剧情ID4040102","TextValue"=>"Sim, senhor!"],
14050=>["Value"=>14050,"TextKey"=>"剧情ID4040103","TextValue"=>"Já reparou na coluna do meio? Não pode ser natural. "],
14051=>["Value"=>14051,"TextKey"=>"剧情ID4040104","TextValue"=>"Com tal altura e forma... Aposto na reputação da minha família sacerdotal que deverá ter sido um altar nos velhos tempos!"],
14052=>["Value"=>14052,"TextKey"=>"剧情ID4040105","TextValue"=>"Este altar parece desolado."],
14053=>["Value"=>14053,"TextKey"=>"剧情ID4040106","TextValue"=>"Certo, deve ser muito antigo."],
14054=>["Value"=>14054,"TextKey"=>"剧情ID4040107","TextValue"=>"Um altar assim, incapaz de ressoar com o poder do Arquidruída, não nos pode ajudar a encontrar Amergin."],
14055=>["Value"=>14055,"TextKey"=>"剧情ID4040108","TextValue"=>"Chefe, precisamos de um dispositivo que possa condensar energia..."],
14056=>["Value"=>14056,"TextKey"=>"剧情ID4040109","TextValue"=>"Os materiais devem ser capazes de resistir à alta temperatura aqui, e a forma deve ser interior."],
14057=>["Value"=>14057,"TextKey"=>"剧情ID4040110","TextValue"=>"Que tal aquelas presas esquisitas perto da lava?"],
14058=>["Value"=>14058,"TextKey"=>"剧情ID4040111","TextValue"=>"Nada mal, Arlan! Não é de admirar que a deusa tenha dito "fique sempre perto dos parceiros importantes"!"],
14059=>["Value"=>14059,"TextKey"=>"剧情ID4040112","TextValue"=>"Certamente! Graças à Deusa!"],
14060=>["Value"=>14060,"TextKey"=>"剧情ID4040113","TextValue"=>"Cala-te! Não estás incluído!"],
14061=>["Value"=>14061,"TextKey"=>"剧情ID4040114","TextValue"=>"Deixemos todos os materiais para o nosso maravilhoso chefe!"],
14062=>["Value"=>14062,"TextKey"=>"剧情ID4050101","TextValue"=>"Chefe, estamos a fazer tantos progressos."],
14063=>["Value"=>14063,"TextKey"=>"剧情ID4050102","TextValue"=>"O altar deve dar para usar!"],
14064=>["Value"=>14064,"TextKey"=>"剧情ID4050103","TextValue"=>"Mas olhem para o céu sombrio! A Enda tem tido dificuldades em subir e descer as escadas do altar. E se ela cair?"],
14065=>["Value"=>14065,"TextKey"=>"剧情ID4050104","TextValue"=>"Nada mau, algo... robusto. Afinal, às vezes não és assim tão irritante."],
14066=>["Value"=>14066,"TextKey"=>"剧情ID4050105","TextValue"=>"Afinal de contas, a Enda é velha... Ummm... Já não é nova."],
14067=>["Value"=>14067,"TextKey"=>"剧情ID4050106","TextValue"=>"O que é que tem dentro de si para me irritar?"],
14068=>["Value"=>14068,"TextKey"=>"剧情ID4050107","TextValue"=>"Vamos construir tochas em ambos os lados das escadas. É muito simples!"],
14069=>["Value"=>14069,"TextKey"=>"剧情ID4060101","TextValue"=>"Sinto que este altar... ainda falta alguma coisa, porque não se sente de todo a Deusa..."],
14070=>["Value"=>14070,"TextKey"=>"剧情ID4060102","TextValue"=>"Mas deve ser suficiente para sentir o Amergin!"],
14071=>["Value"=>14071,"TextKey"=>"剧情ID4060103","TextValue"=>"Está frio...argh...quem está aí?"],
14072=>["Value"=>14072,"TextKey"=>"剧情ID4060104","TextValue"=>"Amergin! Onde está?"],
14073=>["Value"=>14073,"TextKey"=>"剧情ID4060105","TextValue"=>"É... é a Enda? Não faço ideia onde estou... Mas está tanto frio aqui..."],
14074=>["Value"=>14074,"TextKey"=>"剧情ID4060106","TextValue"=>"Frio?"],
14075=>["Value"=>14075,"TextKey"=>"剧情ID4060107","TextValue"=>"Parece que ele não está aqui."],
14076=>["Value"=>14076,"TextKey"=>"剧情ID4060108","TextValue"=>"Não me consigo mexer… Ajudem, $#^*,!@%&:?""],
14077=>["Value"=>14077,"TextKey"=>"剧情ID4060109","TextValue"=>"O que é que disse?"],
14078=>["Value"=>14078,"TextKey"=>"剧情ID4060110","TextValue"=>"Ei, Enda. Eu acho..."],
14079=>["Value"=>14079,"TextKey"=>"剧情ID4060111","TextValue"=>"L"&%*@#$"…"],
14080=>["Value"=>14080,"TextKey"=>"剧情ID4060112","TextValue"=>"Amergin! Aguente-se! Tenho de falar com outra pessoa agora, pode ajudá-lo."],
14081=>["Value"=>14081,"TextKey"=>"剧情ID4060113","TextValue"=>"Tlachtga, já viu esta situação?"],
14082=>["Value"=>14082,"TextKey"=>"剧情ID4060114","TextValue"=>"Ei…"],
14083=>["Value"=>14083,"TextKey"=>"剧情ID4060115","TextValue"=>"A comunicação espiritual não é propriamente a minha especialidade. Mas a minha mãe deparou-se com a mesma situação. O problema deve continuar a ser o altar."],
14084=>["Value"=>14084,"TextKey"=>"剧情ID4060116","TextValue"=>"O poder do altar ainda é demasiado fraco. O mais importante está em falta."],
14085=>["Value"=>14085,"TextKey"=>"剧情ID4060117","TextValue"=>"O poder da Essência... @#$>:%^da Deusa"],
14086=>["Value"=>14086,"TextKey"=>"剧情ID4060118","TextValue"=>"Chefe, acho que já percebi. Vejam a abertura no topo da coluna do altar!"],
14087=>["Value"=>14087,"TextKey"=>"剧情ID4060119","TextValue"=>"Precisamos de preencher a Essência Espiritual e aumentar o poder do altar. Será que a temos?"],
14088=>["Value"=>14088,"TextKey"=>"剧情ID4060120","TextValue"=>"O que diz? Arlan, entrego-lho de imediato."],
14089=>["Value"=>14089,"TextKey"=>"剧情ID4060121","TextValue"=>"Percebi!"],
14090=>["Value"=>14090,"TextKey"=>"剧情ID4070101","TextValue"=>"Amergin, diga algo!"],
14091=>["Value"=>14091,"TextKey"=>"剧情ID4070102","TextValue"=>"Têm de me vir procurar..."],
14092=>["Value"=>14092,"TextKey"=>"剧情ID4070103","TextValue"=>"Desta vez deve correr bem. A sua voz finalmente não soa ambígua como falsa tosse da Meg."],
14093=>["Value"=>14093,"TextKey"=>"剧情ID4070104","TextValue"=>"A Meg é só uma senhora de idade."],
14094=>["Value"=>14094,"TextKey"=>"剧情ID4070105","TextValue"=>"Como disse..."],
14095=>["Value"=>14095,"TextKey"=>"剧情ID4070106","TextValue"=>"Já tinha chegado ao vulcão uma vez, mas não faço ideia do que aconteceu depois. Quando acordei, já estava aqui, seja lá o que for este inferno."],
14096=>["Value"=>14096,"TextKey"=>"剧情ID4070107","TextValue"=>"Apesar do vosso altar chegar até mim, acho que não vos conseguia levar até onde estou..."],
14097=>["Value"=>14097,"TextKey"=>"剧情ID4070108","TextValue"=>"Porque apesar de poder sentir e responder à Enda, este lugar... definitivamente não vai, e vai conseguir esconder-se."],
14098=>["Value"=>14098,"TextKey"=>"剧情ID4070109","TextValue"=>"Alguma ideia?"],
14099=>["Value"=>14099,"TextKey"=>"剧情ID4070110","TextValue"=>"Coexistir com o ambiente...infinitamente...e formar uma circulação."],
14100=>["Value"=>14100,"TextKey"=>"剧情ID4070111","TextValue"=>"O que quer dizer? Deixar as chamas aqui fluir para a cave de gelo onde se encontra?"],
14101=>["Value"=>14101,"TextKey"=>"剧情ID4070112","TextValue"=>"Seu estudante gordo de cabeça mole! Claro que não."],
14102=>["Value"=>14102,"TextKey"=>"剧情ID4070113","TextValue"=>"Circulação... Deixe a lava fluir para criar cinzas, deixe as cinzas subir e solidificar para as rochas, e finalmente deixe as rochas irromper para a lava novamente."],
14103=>["Value"=>14103,"TextKey"=>"剧情ID4070114","TextValue"=>"É de facto um aluno de topo."],
14104=>["Value"=>14104,"TextKey"=>"剧情ID4070115","TextValue"=>"Espere!"],
14105=>["Value"=>14105,"TextKey"=>"剧情ID4080101","TextValue"=>"Isto é... uma cabeça de porco?"],
14106=>["Value"=>14106,"TextKey"=>"剧情ID4080102","TextValue"=>"Uh-huh."],
14107=>["Value"=>14107,"TextKey"=>"剧情ID4080103","TextValue"=>"Com todo o respeito, porque é que tem a forma de uma cabeça de porco?"],
14108=>["Value"=>14108,"TextKey"=>"剧情ID4080104","TextValue"=>"Espere, não devia estar a fazer esta pergunta."],
14109=>["Value"=>14109,"TextKey"=>"剧情ID4080105","TextValue"=>"Deusa! Queridos parceiros são necessários no caminho para o sucesso. Porque não deixamos aqui o meu parceiro, figura de alguma coisa!"],
14110=>["Value"=>14110,"TextKey"=>"剧情ID4080106","TextValue"=>"Vejam como é fofo o nosso padre! Olhem para a forma tão subtil dele ser simpático. "],
14111=>["Value"=>14111,"TextKey"=>"剧情ID4080107","TextValue"=>"Tu!"],
14112=>["Value"=>14112,"TextKey"=>"剧情ID4080108","TextValue"=>"Saiam do caminho, o chefe e eu estamos prestes a começar o altar."],
14113=>["Value"=>14113,"TextKey"=>"剧情ID4090101","TextValue"=>"Suspiro... Enda, hora do espectáculo."],
14114=>["Value"=>14114,"TextKey"=>"剧情ID4090102","TextValue"=>"Amergin está em..."],
14115=>["Value"=>14115,"TextKey"=>"剧情ID4090103","TextValue"=>"O Extremo Oriente... Um lugar gelado e proibido."],
14116=>["Value"=>14116,"TextKey"=>"剧情ID4090104","TextValue"=>"Embora esteja muito calor aqui, penso que deveríamos começar a preparar roupas de Inverno."],
14117=>["Value"=>14117,"TextKey"=>"剧情ID99990101","TextValue"=>"That fog looks more suspicious than any crisis I have resolved since the establishment of the Royal Kingdom ever."],
14118=>["Value"=>14118,"TextKey"=>"剧情ID99990102","TextValue"=>"And it seems we are kind of stuck here. Hmmm, anybody here?"],
14119=>["Value"=>14119,"TextKey"=>"剧情ID99990103","TextValue"=>"Not a soul? Guess we have to figure out how to clear the fog all by ourselves."],
14120=>["Value"=>14120,"TextKey"=>"剧情ID47990201","TextValue"=>"Hey! Well done! The wheat appeared for a reason! "],
14121=>["Value"=>14121,"TextKey"=>"剧情ID99990202","TextValue"=>"Let's harvest some first and then see what can we do with them!"],
14122=>["Value"=>14122,"TextKey"=>"剧情ID99990301","TextValue"=>"Oh! A little spellbook! It appeared all of a sudden after I had the bread."],
14123=>["Value"=>14123,"TextKey"=>"剧情ID99990302","TextValue"=>"The fog seems thinned a bit because of the spellbook… Maybe we can use the spellbook to clear the fog away."],
14124=>["Value"=>14124,"TextKey"=>"剧情ID34990101","TextValue"=>"Great! Now let's make a plan: merge ingredients, cook foods, get spellbooks, and last but most importantly -- clear fog!"],
14125=>["Value"=>14125,"TextKey"=>"剧情ID99990601","TextValue"=>"Ha! What's that? Looks like there is a chest buried under those broken stones."],
14126=>["Value"=>14126,"TextKey"=>"剧情ID99990602","TextValue"=>"Let's open it at once and see what's inside! I can't wait to tell my friends about all this!"],
14127=>["Value"=>14127,"TextKey"=>"剧情ID99990701","TextValue"=>"It seems we have to stay here for a little while. We should make use of these stones and build a shelter."],
14128=>["Value"=>14128,"TextKey"=>"剧情ID99990702","TextValue"=>"We did it! Indeed, whatever magic in that spellbook certainly worked!"],
14129=>["Value"=>14129,"TextKey"=>"剧情ID99991001","TextValue"=>"I'm curious about what's gonna happen if we merge 5 items of the same kind at once."],
14130=>["Value"=>14130,"TextKey"=>"剧情ID99991002","TextValue"=>"I think we should give it a go. It seems like something wonderful might follow…"],
14131=>["Value"=>14131,"TextKey"=>"剧情ID99990801","TextValue"=>"What's this?"],
14132=>["Value"=>14132,"TextKey"=>"剧情ID99990802","TextValue"=>"It looks like nothing but ruins. But in a very short time, I promise my brother and I can build a perfect base for a stone castle! "],
14133=>["Value"=>14133,"TextKey"=>"剧情ID99990803","TextValue"=>"Right on! The most urgent affair should be constructing a solid castle to shield us against unknown challenges."],
14134=>["Value"=>14134,"TextKey"=>"剧情ID99990501","TextValue"=>"This hat is beaming faint magic."],
14135=>["Value"=>14135,"TextKey"=>"剧情ID99990502","TextValue"=>"Keep merging! I think this might be a clue that leads us to the right man to help us!"],
14136=>["Value"=>14136,"TextKey"=>"剧情ID99990901","TextValue"=>"What is this magical base with four slots on top? Looks like we need something to activate it!"],
14137=>["Value"=>14137,"TextKey"=>"剧情ID99990902","TextValue"=>"Your Majesty, this is a base for a castle. As long as we build the corresponding houses and place them on top of it, we can easily construct our Royal Castle."],
14138=>["Value"=>14138,"TextKey"=>"剧情ID99990903","TextValue"=>"We will remind you to place those houses on top after we finished construction."],
14139=>["Value"=>14139,"TextKey"=>"剧情ID99991101","TextValue"=>"I can't wait to find out what kind of mysterious treasure is hidden inside."],
14140=>["Value"=>14140,"TextKey"=>"剧情ID99991102","TextValue"=>"We can use it to to merge with stone  resources. Then we can have unlimited stones!"],
14141=>["Value"=>14141,"TextKey"=>"剧情ID99991201","TextValue"=>"Very helpful magic crystal! It can be played as anything you want!"],
14142=>["Value"=>14142,"TextKey"=>"剧情ID99991202","TextValue"=>"With it, you only need 2, not 3, of the same item to merge! Try using it!"],
14143=>["Value"=>14143,"TextKey"=>"剧情ID99991203","TextValue"=>"Remember the Magic Crystal can substitute any item you need in game!"],
14144=>["Value"=>14144,"TextKey"=>"剧情ID30400301","TextValue"=>"Look at this little cute stone frame!"],
14145=>["Value"=>14145,"TextKey"=>"剧情ID30400302","TextValue"=>"Compared to my finest architecture, this is far from close. Come on, Watt! We need more stone bricks!"],
14146=>["Value"=>14146,"TextKey"=>"剧情ID30400401","TextValue"=>"Not bad! You built a door with stones."],
14147=>["Value"=>14147,"TextKey"=>"剧情ID30400402","TextValue"=>"Thanks for your kind words. Please give us more time, we can surely build something better!"],
14148=>["Value"=>14148,"TextKey"=>"剧情ID30400501","TextValue"=>"You guys are indeed excellent stonecutter!"],
14149=>["Value"=>14149,"TextKey"=>"剧情ID30400601","TextValue"=>"Wally and I have constructed a much bigger stone house. I have to say that the arduous efforts we had made totally paid back."],
14150=>["Value"=>14150,"TextKey"=>"剧情ID30400602","TextValue"=>"You sure did! Now, I need a high tower to watch the remote lands."],
14151=>["Value"=>14151,"TextKey"=>"剧情ID30400701","TextValue"=>"With only four more houses like this, I can finally have a Castle on this land."],
14152=>["Value"=>14152,"TextKey"=>"剧情ID30400801","TextValue"=>"Castle completed! We can see it as a treasure box!"],
14153=>["Value"=>14153,"TextKey"=>"剧情ID30400802","TextValue"=>"That's right! There are so many goodies inside the Castle."],
14154=>["Value"=>14154,"TextKey"=>"剧情ID31610301","TextValue"=>"The power of the magic hat is greatly boosted! We should find its master for they must a mighty warlock!"],
14155=>["Value"=>14155,"TextKey"=>"剧情ID31610401","TextValue"=>"Humpf! A rabbit!"],
14156=>["Value"=>14156,"TextKey"=>"剧情ID31610402","TextValue"=>"Haha. Yup! If you have fresh and juicy carrots, don't forget my name… Oh, that will be Morris."],
14157=>["Value"=>14157,"TextKey"=>"剧情ID31610403","TextValue"=>"Morris, then you are destined to join my army! Speaking of the knowledge of delicacies, I'm second to none in the whole Hill Kingdom."],
14158=>["Value"=>14158,"TextKey"=>"剧情ID30410301","TextValue"=>"There are logs. We can build a much more comfortable house."],
14159=>["Value"=>14159,"TextKey"=>"剧情ID30410302","TextValue"=>"Cool. Take it slow this time. There is still time till the cold season creeps."],
14160=>["Value"=>14160,"TextKey"=>"剧情ID30410401","TextValue"=>"A decent ceiling at last."],
14161=>["Value"=>14161,"TextKey"=>"剧情ID30410402","TextValue"=>"Keep going! My fireplace is missing a chimney."],
14162=>["Value"=>14162,"TextKey"=>"剧情ID30410501","TextValue"=>"Why don't we build a lovely attic to reserve all my yummy carrots? They are the best foods in winter."],
14163=>["Value"=>14163,"TextKey"=>"剧情ID30410502","TextValue"=>"Haha, aren't carrots the best foods in all four seasons to you, Morris?"],
14164=>["Value"=>14164,"TextKey"=>"剧情ID30410601","TextValue"=>"I think I can use some more space to equip my little magic widgets."],
14165=>["Value"=>14165,"TextKey"=>"剧情ID30410602","TextValue"=>"The frame structure I designed is perfect for a bigger house."],
14166=>["Value"=>14166,"TextKey"=>"剧情ID30410701","TextValue"=>"What a beautiful house! Watt and Wally, I didn't expect your woodwork skills to be equally excellent!"],
14167=>["Value"=>14167,"TextKey"=>"剧情ID30410801","TextValue"=>"I can't believe one can actually build an outstanding architecture with zero magic spell cast."],
14168=>["Value"=>14168,"TextKey"=>"剧情ID30410802","TextValue"=>"My brother is an expert in architecture design. As for me… I'm good at being a cheerleader."],
14169=>["Value"=>14169,"TextKey"=>"剧情ID30410803","TextValue"=>"Watt, we need to catch up!"],
14170=>["Value"=>14170,"TextKey"=>"剧情ID30410901","TextValue"=>"Behold! A warm and cozy castle is ready!"],
14171=>["Value"=>14171,"TextKey"=>"剧情ID30410902","TextValue"=>"Nice! It is warm in winter and cool in summer! I suggest you prepare some hot biscuits for afternoon tea in winter times."],
14172=>["Value"=>14172,"TextKey"=>"剧情ID30410903","TextValue"=>"Or some carrot cakes and loaves of bread."],
14173=>["Value"=>14173,"TextKey"=>"剧情ID31620301","TextValue"=>"Morris, who would need these many harps?"],
14174=>["Value"=>14174,"TextKey"=>"剧情ID31620302","TextValue"=>"Ummm, I can't think of anyone. But this person must be a musician!"],
14175=>["Value"=>14175,"TextKey"=>"剧情ID31620401","TextValue"=>"I feel the power within these harps continues to grow."],
14176=>["Value"=>14176,"TextKey"=>"剧情ID31620501","TextValue"=>"These harps can be the best sword for a musician. So, can it keep leveling up?"],
14177=>["Value"=>14177,"TextKey"=>"剧情ID31620601","TextValue"=>"I can almost see the grandness of this harp being played in a luxurious music hall of the House of Hill."],
14178=>["Value"=>14178,"TextKey"=>"剧情ID31620602","TextValue"=>"I believe the owner of this harp will be given such a chance."],
14179=>["Value"=>14179,"TextKey"=>"剧情ID31620701","TextValue"=>"I'm Ramble, your humble servant. I have one more thing to celebrate in songs!"],
14180=>["Value"=>14180,"TextKey"=>"剧情ID31620702","TextValue"=>"Umm, can someone please make me an Icecream Muffin? I'm sure your beautiful music will be a perfect combo to it, which is even better than cinnamon powder!"],
14181=>["Value"=>14181,"TextKey"=>"剧情ID31620703","TextValue"=>"*In the arc music hall, in the breezy spring fields, in the presence of the one, whom the hymn gives*"],
14182=>["Value"=>14182,"TextKey"=>"剧情ID30420401","TextValue"=>"I quite like this exquisite door. Well, perhaps a wind vane will be needed over the sea?"],
14183=>["Value"=>14183,"TextKey"=>"剧情ID30420501","TextValue"=>"Ohh, it so reminds me of those old adventure days. Listen, we need to increase the height of the base. Y'all know waves crashing is no kidding."],
14184=>["Value"=>14184,"TextKey"=>"剧情ID30420601","TextValue"=>"Pretty good! Wally, you are no doubt a genius!"],
14185=>["Value"=>14185,"TextKey"=>"剧情ID30420602","TextValue"=>"Haha, Wally never fails you! And... since I've known him for my life, it's far from the time to celebrate."],
14186=>["Value"=>14186,"TextKey"=>"剧情ID30420701","TextValue"=>"Praise be to the brilliant craftsman! And what else do we need… bright lights dancing in the dark night, becoming the only beacon to the travelers."],
14187=>["Value"=>14187,"TextKey"=>"剧情ID30420801","TextValue"=>"What a wonderful boathouse! With only a couple more like this, our cruise ship will be ready to set sail!"],
14188=>["Value"=>14188,"TextKey"=>"剧情ID30420901","TextValue"=>"I can hear the waves beating and I can smell the storm coming! How exciting!"],
14189=>["Value"=>14189,"TextKey"=>"剧情ID30420902","TextValue"=>"Haha, check out Ramble's dreaming about adventures already! Watt and Wally, you two are indeed the best craftsmen ever!"],
14190=>["Value"=>14190,"TextKey"=>"剧情ID30420903","TextValue"=>"Thanks for your appreciation, Your Majesty! This boat castle also means our strength is greatly enhanced! "],
14191=>["Value"=>14191,"TextKey"=>"剧情ID31630301","TextValue"=>"That drum grew taller, looking like it's for an adult now! I want to jam a little bit, lol!"],
14192=>["Value"=>14192,"TextKey"=>"剧情ID31630401","TextValue"=>"In my opinion, a belt is needed for the drum. That'll be protective to the drumhead."],
14193=>["Value"=>14193,"TextKey"=>"剧情ID31630501","TextValue"=>"How about a fixation on the drum frame? Ramble knows musicians like him will get so carried away during the performance. It'll be a shame if it goes broken."],
14194=>["Value"=>14194,"TextKey"=>"剧情ID31630502","TextValue"=>"Correct. I should count how many harps I've played. One, two, three, four…"],
14195=>["Value"=>14195,"TextKey"=>"剧情ID31630601","TextValue"=>"The feather decoration looks very cute and unique. What do you think, Ramble?"],
14196=>["Value"=>14196,"TextKey"=>"剧情ID31630602","TextValue"=>"Yeah… but it might get in the way while playing. It's better to change the décor's location."],
14197=>["Value"=>14197,"TextKey"=>"剧情ID31630701","TextValue"=>"Now, it won't bother beating the drum. "],
14198=>["Value"=>14198,"TextKey"=>"剧情ID31630702","TextValue"=>"But the original simplicity and delicate beauty are weakened. Ramble, do you think you can improve that?"],
14199=>["Value"=>14199,"TextKey"=>"剧情ID31630801","TextValue"=>"Did you guys find my drum? Thanks!"],
14200=>["Value"=>14200,"TextKey"=>"剧情ID31630802","TextValue"=>"What a lovely wee lass!"],
14201=>["Value"=>14201,"TextKey"=>"剧情ID31630803","TextValue"=>"*Giggles* Thank you. I'm Melody, feel free to call me Mel! I have no idea why I woke up here in the fog."],
14202=>["Value"=>14202,"TextKey"=>"剧情ID31630804","TextValue"=>"That happened to everybody. Mel, glad you are joining us in this adventure!"],
14203=>["Value"=>14203,"TextKey"=>"剧情ID30430301","TextValue"=>"Beautiful pearl! I always want one, even though it doesn't have any function."],
14204=>["Value"=>14204,"TextKey"=>"剧情ID30430302","TextValue"=>"I know you'll like it! Well, Mel, we can build a pearl house next."],
14205=>["Value"=>14205,"TextKey"=>"剧情ID30430401","TextValue"=>"Wally is so creative! Pearl rooftop will be beautiful, but wouldn't that be too fragile?"],
14206=>["Value"=>14206,"TextKey"=>"剧情ID30430501","TextValue"=>"Dearest Watt and Wally, can you build it more spacious? More space is needed to stock pearls and shells."],
14207=>["Value"=>14207,"TextKey"=>"剧情ID30430502","TextValue"=>"One sec."],
14208=>["Value"=>14208,"TextKey"=>"剧情ID30430601","TextValue"=>"How about adding some seaweeds as décor?"],
14209=>["Value"=>14209,"TextKey"=>"剧情ID30430701","TextValue"=>"Stunning! Hahaha, I'm so happy. Can't stop smiling whenever I see the pearl house."],
14210=>["Value"=>14210,"TextKey"=>"剧情ID30430702","TextValue"=>"Aww, Mel, wait a sec. I stole — I mean, borrowed the design sketch from Wally."],
14211=>["Value"=>14211,"TextKey"=>"剧情ID30430801","TextValue"=>"Wow! There are two spires! This landscape is so glorious that I haven't seen it even in my most unstrained dream!"],
14212=>["Value"=>14212,"TextKey"=>"剧情ID30430802","TextValue"=>"It only takes four mansions like this to build a top-notch castle."],
14213=>["Value"=>14213,"TextKey"=>"剧情ID30430901","TextValue"=>"What do you think? Not bad, right? I knew Mel would love those spires."],
14214=>["Value"=>14214,"TextKey"=>"剧情ID30430902","TextValue"=>"Can I look around? Alrighty! I'm coming in! Aha, where's my drum? I want to drop some beats."],
14215=>["Value"=>14215,"TextKey"=>"剧情ID30430903","TextValue"=>"Let me be your accompany, Mel."],
14216=>["Value"=>14216,"TextKey"=>"剧情ID31640301","TextValue"=>"This crown should belong to someone important. Your Majesty, does that ring any bells?"],
14217=>["Value"=>14217,"TextKey"=>"剧情ID31640302","TextValue"=>"I'm not sure. It doesn't have the Royal Lable of House Hill. So, I really can't think of anyone who it belongs."],
14218=>["Value"=>14218,"TextKey"=>"剧情ID31640401","TextValue"=>"Magnificent gold, workmanship glowed. Used as a symbol in poems, represent power the most."],
14219=>["Value"=>14219,"TextKey"=>"剧情ID31640501","TextValue"=>"Inlaid with emerald, ha, very much in line with my Queen's aesthetic!"],
14220=>["Value"=>14220,"TextKey"=>"剧情ID31640601","TextValue"=>"What? Morris just told me such a luxurious crown is not even superior!"],
14221=>["Value"=>14221,"TextKey"=>"剧情ID31640602","TextValue"=>"Yup. I can feel the magic power hidden in the crown is far from the upper limit."],
14222=>["Value"=>14222,"TextKey"=>"剧情ID31640701","TextValue"=>"When the crown's owner came, I wonder if I could borrow to try it on? It is sooooo pretty!"],
14223=>["Value"=>14223,"TextKey"=>"剧情ID31640801","TextValue"=>"My! I can feel the magic is vibrating intensely. Its owner will soon arrive!"],
14224=>["Value"=>14224,"TextKey"=>"剧情ID31640901","TextValue"=>"Oh my goodness! Hill, my old pal!"],
14225=>["Value"=>14225,"TextKey"=>"剧情ID31640902","TextValue"=>"No way! I can't believe you are stuck here too! Oi oi, everyone! Let me introduce the King of Lion, Simba."],
14226=>["Value"=>14226,"TextKey"=>"剧情ID31640903","TextValue"=>"I have made a preliminary judgment about the surroundings here. There's no time to delay. Keep constructing and expanding territory."],
14227=>["Value"=>14227,"TextKey"=>"剧情ID30440301","TextValue"=>"This shabby wagon can barely shelter me from the wind and rain."],
14228=>["Value"=>14228,"TextKey"=>"剧情ID30440302","TextValue"=>"Lion King, you are right. We still need more time."],
14229=>["Value"=>14229,"TextKey"=>"剧情ID30440401","TextValue"=>"It is basic. However, that's a great model for further processing."],
14230=>["Value"=>14230,"TextKey"=>"剧情ID30440402","TextValue"=>"Improve the driver's seat. The long journey shall not be easy."],
14231=>["Value"=>14231,"TextKey"=>"剧情ID30440501","TextValue"=>"Nice! Guest seats also need to be improved. Watt and Wally, can you two please do us one more favor?"],
14232=>["Value"=>14232,"TextKey"=>"剧情ID30440601","TextValue"=>"Woohoo! Comfort level considerably increased. Well, I say we build it more confined. Privacy is no lesser than safety. Simba, I only suggested it because of our cooperation last time."],
14233=>["Value"=>14233,"TextKey"=>"剧情ID30440701","TextValue"=>"Indeed excellent! I've heard about your craftmanship, Watt and Wally. Too bad my lions only have fluffy paws, and this kind of delicate work is no match for lions."],
14234=>["Value"=>14234,"TextKey"=>"剧情ID30440702","TextValue"=>"Lol! Thanks for your appreciation, Lion King! There's still room for improvement. Wait and see what happens!"],
14235=>["Value"=>14235,"TextKey"=>"剧情ID30440801","TextValue"=>"Wally, can you add another story to it? The magic circulation requires height."],
14236=>["Value"=>14236,"TextKey"=>"剧情ID30440802","TextValue"=>"Gotcha! High-ceiling design is my expertise."],
14237=>["Value"=>14237,"TextKey"=>"剧情ID30440901","TextValue"=>"Watt and Wally, do you want to follow me to my Kingdom after all this? I guarantee that you will be treated even better than in Kingdom Hill."],
14238=>["Value"=>14238,"TextKey"=>"剧情ID30440902","TextValue"=>"Simba, I'm right here! I thought you would at least avoid me while poaching my staff!"],
14239=>["Value"=>14239,"TextKey"=>"剧情ID30441001","TextValue"=>"This castle means a lot to me. It allows me to live the spontaneous life I love and takes me to wherever I want."],
14240=>["Value"=>14240,"TextKey"=>"剧情ID30441002","TextValue"=>"Simba has been running freely over the fields. No wonder he wants a mobile castle to live in."],
14241=>["Value"=>14241,"TextKey"=>"剧情ID30441003","TextValue"=>"Watt and Wally, please take serious consideration into the advice I gave earlier."],
14242=>["Value"=>14242,"TextKey"=>"剧情ID31650301","TextValue"=>"Wow! It's getting better! But the portion for me is still too small."],
14243=>["Value"=>14243,"TextKey"=>"剧情ID31650401","TextValue"=>"The magic around the foods and the table are filling up. "],
14244=>["Value"=>14244,"TextKey"=>"剧情ID31650501","TextValue"=>"I'm a carnivore. But I know Hill's a sweet tooth. If you stay out of mine, I'll stay out of yours."],
14245=>["Value"=>14245,"TextKey"=>"剧情ID31650601","TextValue"=>"This reminds me of the old times when I host banquets. Though we are a little short of number, we can surely prepare a big meal for dinner tonight!"],
14246=>["Value"=>14246,"TextKey"=>"剧情ID31650701","TextValue"=>"This symbolized a fairy evening."],
14247=>["Value"=>14247,"TextKey"=>"剧情ID31650801","TextValue"=>"The magic is reaching the pinnacle. We can soon meet the owner of these yummy visions. "],
14248=>["Value"=>14248,"TextKey"=>"剧情ID31650901","TextValue"=>"…"],
14249=>["Value"=>14249,"TextKey"=>"剧情ID31650902","TextValue"=>"Hiya, lovely girl! What's your name?"],
14250=>["Value"=>14250,"TextKey"=>"剧情ID31650903","TextValue"=>"I… ummmm... I don't have a name. They call me "Little Match Girl". Perhaps… maybe... you can call me "Match"?"],
14251=>["Value"=>14251,"TextKey"=>"剧情ID31650904","TextValue"=>"Okay. Don't be afraid, kid. Come in and warm yourself up in our castle."],
14252=>["Value"=>14252,"TextKey"=>"剧情ID30450301","TextValue"=>"What's up, Match. Is this matchbox something you are thinking of?"],
14253=>["Value"=>14253,"TextKey"=>"剧情ID30450302","TextValue"=>"Yes, yes! If I curl up, I can squeeze myself in it, protecting myself against the wind."],
14254=>["Value"=>14254,"TextKey"=>"剧情ID30450401","TextValue"=>"Thank you, Watt! I can't imagine I can own a hut with beams one day. So happy!"],
14255=>["Value"=>14255,"TextKey"=>"剧情ID30450501","TextValue"=>"I can actually stand up inside the house. No more curling up. Hooray!"],
14256=>["Value"=>14256,"TextKey"=>"剧情ID30450601","TextValue"=>"Match, I think you'll like this windproof curtain."],
14257=>["Value"=>14257,"TextKey"=>"剧情ID30450602","TextValue"=>"Totally! I can save some matches to warm up now."],
14258=>["Value"=>14258,"TextKey"=>"剧情ID30450701","TextValue"=>"Ta-da~ The high-ceiling design I'm best at!"],
14259=>["Value"=>14259,"TextKey"=>"剧情ID30450702","TextValue"=>"Thank you so much! This is the prettiest house I've ever seen in my life… even better than those rich people's houses on the streets in the past."],
14260=>["Value"=>14260,"TextKey"=>"剧情ID30450801","TextValue"=>"If you can come up with one request for the house, what would it be?"],
14261=>["Value"=>14261,"TextKey"=>"剧情ID30450802","TextValue"=>"Ahhh… Owning a house is already beyond my expectation. I don't have any requests."],
14262=>["Value"=>14262,"TextKey"=>"剧情ID30450803","TextValue"=>"Not with that attitude, Match! C'mon, think harder! What do you really really really want?"],
14263=>["Value"=>14263,"TextKey"=>"剧情ID30450804","TextValue"=>"Umm… I think… that will be warmth. Yeah! I want it to be super warm!"],
14264=>["Value"=>14264,"TextKey"=>"剧情ID30450901","TextValue"=>"As long as we build four mansions like this, Little Match Girl will have her private castle!"],
14265=>["Value"=>14265,"TextKey"=>"剧情ID30451001","TextValue"=>"Are you guys serious? … This beautiful castle… is MINE?"],
14266=>["Value"=>14266,"TextKey"=>"剧情ID30451002","TextValue"=>"Of course, my dear child! This land is full of dangers. That's why we should value our accommodations. "],
14267=>["Value"=>14267,"TextKey"=>"剧情ID30451003","TextValue"=>"Waaah… Thank you! Thank you all!"],
14268=>["Value"=>14268,"TextKey"=>"剧情ID30451004","TextValue"=>"Go take some proper rest and be ready for the upcoming challenges!"],
14269=>["Value"=>14269,"TextKey"=>"剧情ID31660301","TextValue"=>"Fixation was a great idea. However, can we change its frame to a modern design? It looks not so transparent now."],
14270=>["Value"=>14270,"TextKey"=>"剧情ID31660401","TextValue"=>"Who will be the lamp holder?"],
14271=>["Value"=>14271,"TextKey"=>"剧情ID31660501","TextValue"=>"The fire is getting so much more bright! Morris, do you agree?"],
14272=>["Value"=>14272,"TextKey"=>"剧情ID31660502","TextValue"=>"Indeed, Your Majesty. This is a sign of enhanced magic."],
14273=>["Value"=>14273,"TextKey"=>"剧情ID31660601","TextValue"=>"Is this… a pumpkin? *Sweet'o'pumpkin, spooky'o'night* It's a perfect plant for my serenade!"],
14274=>["Value"=>14274,"TextKey"=>"剧情ID31660701","TextValue"=>"A lovely pumpkin lamp. It can be used as a decorative ornament."],
14275=>["Value"=>14275,"TextKey"=>"剧情ID31660702","TextValue"=>"It's hard to tell that the magic power it possessed is quite remarkable."],
14276=>["Value"=>14276,"TextKey"=>"剧情ID31660801","TextValue"=>"Did you guys notice that the impression of the pumpkin lamp just changed! It looks more and more like a human… Spooky..."],
14277=>["Value"=>14277,"TextKey"=>"剧情ID31660802","TextValue"=>"I have a hunch that this pumpkin friend will be meeting us soon."],
14278=>["Value"=>14278,"TextKey"=>"剧情ID31660901","TextValue"=>"Greetings, y'all! Ready for the spooky party at midnight?"],
14279=>["Value"=>14279,"TextKey"=>"剧情ID31660902","TextValue"=>"Pumpkinhead! Don't scare young kids. By the way, is your head ripe and sweet when you pick it?"],
14280=>["Value"=>14280,"TextKey"=>"剧情ID31660903","TextValue"=>"Ummm… actually pumpkins are not edible for they contain a toxic chemical called "pumpkin acid". And don't call me pumpkinhead, my name is Jack!"],
14281=>["Value"=>14281,"TextKey"=>"剧情ID31660904","TextValue"=>"Alright, Jack. That is a lie. Are you afraid I'm going to eat you?"],
14282=>["Value"=>14282,"TextKey"=>"剧情ID31660905","TextValue"=>"… See you, Mr. King!"],
14283=>["Value"=>14283,"TextKey"=>"剧情ID30460301","TextValue"=>"For me, straws are the best protection against cold."],
14284=>["Value"=>14284,"TextKey"=>"剧情ID30460401","TextValue"=>"Help me think… what are the things people might be startled at first glance? Oh right! Skeleton! I want to put a skeleton set on my front gate. "],
14285=>["Value"=>14285,"TextKey"=>"剧情ID30460501","TextValue"=>"Why don't you add something pumpkins to your façade? Just like what I did to mine with carrots."],
14286=>["Value"=>14286,"TextKey"=>"剧情ID30460601","TextValue"=>"Do you want to open a skylight, Mr. Jack? To do that, we have to take off the skeleton décor."],
14287=>["Value"=>14287,"TextKey"=>"剧情ID30460701","TextValue"=>"I really like it! But I feel that pumpkin can be bigger. Can you help me out?"],
14288=>["Value"=>14288,"TextKey"=>"剧情ID30460702","TextValue"=>"Sure thing. You can always trust Watt with carving."],
14289=>["Value"=>14289,"TextKey"=>"剧情ID30460801","TextValue"=>"Wow, soooooo beautiful! Hem hem, no, I mean… I still need a lantern on it! Yup, a lantern!"],
14290=>["Value"=>14290,"TextKey"=>"剧情ID30460901","TextValue"=>"This mansion looks like a large Jack! Hah-hah-hah, a small Jack living in a big Jack!"],
14291=>["Value"=>14291,"TextKey"=>"剧情ID30461001","TextValue"=>"Wow, my pumpkin, my straws, my lantern! Watt and Wally, you two are simply geniuses! I announce that you two are officially on top of my PRANKING LIST!"],
14292=>["Value"=>14292,"TextKey"=>"剧情ID30461002","TextValue"=>"Oh geez, cut me some slacks. But please do not let Watt escape!"],
